INSERT INTO `gen_other_info` VALUES (1,'2014-08-18','–ü—ñ–¥—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è –¥–æ—Å—Ç–æ–≤—ñ—Ä–Ω–æ—Å—Ç—ñ –ø–æ—Ä—Ç–∞–ª—É','–ü–µ—Ä—à –Ω—ñ–∂ —Ä–æ–∑–ø–æ—á–∏–Ω–∞—Ç–∏ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é –∞–±–æ –∞–≤—Ç–æ—Ä–∏–∑–∞—Ü—ñ—é –Ω–∞ –ø–æ—Ä—Ç–∞–ª—ñ —Ä–µ–∫–æ–º–µ–Ω–¥—É—î–º–æ –∑–¥—ñ–π—Å–Ω–∏—Ç–∏ –ø–µ—Ä–µ–≤—ñ—Ä–∫—É –∞–≤—Ç–µ–Ω—Ç–∏—á–Ω–æ—Å—Ç—ñ –ø–æ—Ä—Ç–∞–ª—É.','<p>–ü–µ—Ä—à –Ω—ñ–∂ —Ä–æ–∑–ø–æ—á–∏–Ω–∞—Ç–∏ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é –∞–±–æ –∞–≤—Ç–æ—Ä–∏–∑–∞—Ü—ñ—é –Ω–∞ –ø–æ—Ä—Ç–∞–ª—ñ —Ä–µ–∫–æ–º–µ–Ω–¥—É—î–º–æ –∑–¥—ñ–π—Å–Ω–∏—Ç–∏ –ø–µ—Ä–µ–≤—ñ—Ä–∫—É –∞–≤—Ç–µ–Ω—Ç–∏—á–Ω–æ—Å—Ç—ñ –ø–æ—Ä—Ç–∞–ª—É.</p>\r\n\r\n<p>–î–ª—è –ø–µ—Ä–µ–≤—ñ—Ä–∫–∏ –∞–≤—Ç–µ–Ω—Ç–∏—á–Ω–æ—Å—Ç—ñ –ø–æ—Ä—Ç–∞–ª—É –Ω–µ–æ–±—Ö—ñ–¥–Ω–æ:</p>\r\n\r\n<p>1 –ó–∞–≤–∞–Ω—Ç–∞–∂–∏—Ç–∏ –∞—Ä—Ö—ñ–≤, —è–∫–∏–π –º—ñ—Å—Ç–∏—Ç—å –ø—ñ–¥–ø–∏—Å–∞–Ω–∏–π –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω–æ—é –ø–µ—á–∞—Ç–∫–æ—é –ö–ü –û–Ü–ê–¶ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç –ø–æ—Ä—Ç–∞–ª—É —Ç–∞ –∫–æ–º–ø–ª–µ–∫—Ç –ø–æ—Å–∏–ª–µ–Ω–∏—Ö —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—ñ–≤, –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö –¥–ª—è –∑–¥—ñ–π—Å–Ω–µ–Ω–Ω—è –ø–µ—Ä–µ–≤—ñ—Ä–∫–∏. &nbsp;(<a href=\"https://cnap.odessa.gov.ua/auth/cnap_certs.zip\">–∑–∞–≤–∞–Ω—Ç–∞–∂–∏—Ç–∏</a>)</p>\r\n\r\n<p>2 –†–æ–∑–ø–∞–∫—É–≤–∞—Ç–∏ –∞—Ä—Ö—ñ–≤ –±—É–¥—å-—è–∫–∏–º –∑ –∞—Ä—Ö—ñ–≤–∞—Ç–æ—Ä—ñ–≤ (–Ω–∞–ø—Ä–∏–∫–ª–∞–¥, <a href=\"http://www.rarlab.com/download.htm\">WinRar</a>, <a href=\"http://www.7-zip.org/\">7zip</a>, <a href=\"http://peazip.sourceforge.net/\">PeaZip</a>) —É –∑—Ä—É—á–Ω—É –¥–ª—è –í–∞—Å –ø–∞–ø–∫—É –Ω–∞ –∫–æ–º–ø&rsquo;—é—Ç–µ—Ä—ñ.</p>\r\n\r\n<p>3 –í–ø–µ–≤–Ω–∏—Ç–∏—Å—å, –∑–∞ –¥–æ–ø–æ–º–æ–≥–æ—é –Ω–∞—è–≤–Ω–æ–≥–æ —É –í–∞—Å –∑–∞—Å–æ–±—É —Ä–æ–±–æ—Ç–∏ –∑ –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω–∏–º —Ü–∏—Ñ—Ä–æ–≤–∏–º –ø—ñ–¥–ø–∏—Å–æ–º, —É —á–∏–Ω–Ω–æ—Å—Ç—ñ –Ω–∞–∫–ª–∞–¥–µ–Ω–æ–≥–æ –Ω–∞ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω–æ–≥–æ —Ü–∏—Ñ—Ä–æ–≤–æ–≥–æ –ø—ñ–¥–ø–∏—Å—É —Ç–∞ —É —Ñ–∞–∫—Ç—ñ, —â–æ –ø—ñ–¥–ø–∏—Å –Ω–∞–∫–ª–∞–¥–µ–Ω–æ –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω–æ—é –ø–µ—á–∞—Ç–∫–æ—é –ö–ü –û–Ü–ê–¶. –Ø–∫—â–æ –¥–∞–Ω—ñ –≤–∏–º–æ–≥–∏ –≤–∏–∫–æ–Ω–∞–Ω–æ - —Ü—ñ–ª—ñ—Å–Ω—ñ—Å—Ç—å —Ñ–∞–π–ª—É –Ω–µ –ø–æ—Ä—É—à–µ–Ω–∞.</p>\r\n\r\n<p>–ù–∞–ø—Ä–∏–∫–ª–∞–¥, –∑–∞ –¥–æ–ø–æ–º–æ–≥–æ—é –ø—Ä–æ–≥—Ä–∞–º–Ω–æ–≥–æ –∫–æ–º–ø–ª–µ–∫—Å—É &laquo;<a href=\"http://acskidd.gov.ua/korustyvach_csk\">–Ü–Ü–¢ –ö–æ—Ä–∏—Å—Ç—É–≤–∞—á –¶–°–ö-1</a>&raquo; —Ü–µ –º–æ–∂–Ω–∞ –∑—Ä–æ–±–∏—Ç–∏ –Ω–∞—Å—Ç—É–ø–Ω–∏–º —á–∏–Ω–æ–º:</p>\r\n\r\n<p>–ê) –î–æ–¥–∞—Ç–∏ –≤ –∫–∞—Ç–∞–ª–æ–≥ —ñ–∑ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞–º–∏ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∏, —è–∫—ñ –∑–Ω–∞—Ö–æ–¥—è—Ç—å—Å—è –≤ –ø–∞–ø—Ü—ñ Certs –∞—Ä—Ö—ñ–≤—É.</p>\r\n\r\n<p>–†–æ–∑—Ç–∞—à—É–≤–∞–Ω–Ω—è –∫–∞—Ç–∞–ª–æ–≥—É —ñ–∑ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞–º–∏ –º–æ–∂–Ω–∞ –¥—ñ–∑–Ω–∞—Ç–∏—Å—è –Ω–∞—Å—Ç—É–ø–Ω–∏–º —á–∏–Ω–æ–º: &laquo;–ü–∞—Ä–∞–º–µ—Ç—Ä–∏&raquo; - &laquo;–í—Å—Ç–∞–Ω–æ–≤–∏—Ç–∏&hellip;&raquo; - &laquo;–ö–∞—Ç–∞–ª–æ–≥ –∑ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞–º–∏ —Ç–∞ –°–í–°&raquo; (—Ä–∏—Å.1).</p>\r\n\r\n<p><img alt=\"\" src=\"https://cnap.odessa.gov.ua/auth/integr7.png\" style=\"height:312px; margin-left:auto; margin-right:auto; width:662px\" />–†–∏—Å—É–Ω–æ–∫ 1 - –ü–µ—Ä–µ–≤—ñ—Ä–∫–∞ –º—ñ—Å—Ü—è —Ä–æ–∑—Ç–∞—à—É–≤–∞–Ω–Ω—è –∫–∞—Ç–∞–ª–æ–≥—É —ñ–∑ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞–º–∏</p>\r\n\r\n<p>–ë) –î–ª—è –ø–µ—Ä–µ–≤—ñ—Ä–∫–∏ –ï–¶–ü –Ω–µ–æ–±—Ö—ñ–¥–Ω–æ –Ω–∞—Ç–∏—Å–Ω—É—Ç–∏ &laquo;–§–∞–π–ª–∏&raquo; - &laquo;–ü–µ—Ä–µ–≤—ñ—Ä–∏—Ç–∏&raquo; - &laquo;–í—ñ–¥–º—ñ–Ω–∞&raquo; - &laquo;–î–æ–¥–∞—Ç–∏&hellip;&raquo;, –æ–±—Ä–∞—Ç–∏ —Ñ–∞–π–ª cnap.odessa.gov.ua.crt —ñ–∑ –ø–∞–ø–∫–∏ files –∞—Ä—Ö—ñ–≤—É &nbsp;—Ç–∞ –Ω–∞—Ç–∏—Å–Ω—É—Ç–∏ &quot;–ü–µ—Ä–µ–≤—ñ—Ä–∏—Ç–∏&quot;.</p>\r\n\r\n<p>4 –ü–æ—Ä—ñ–≤–Ω—è—Ç–∏ –≤–º—ñ—Å—Ç —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—ñ–≤ –ø–æ—Ä—Ç–∞–ª—É.</p>\r\n\r\n<p>–û—Ç—Ä–∏–º–∞—Ç–∏ –≤–º—ñ—Å—Ç —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—É —É:</p>\r\n\r\n<p>–±—Ä–∞—É–∑–µ—Ä—ñ Firefox &ndash; –Ω–∞—Ç–∏—Å–Ω—É—Ç–∏ –Ω–∞ –∑–Ω–∞—á–æ–∫ &quot;–ö—É–ª—ñ&quot; —Ç–∞ &quot;–†–æ–∑–∫–∞–∂—ñ—Ç—å –º–µ–Ω—ñ –ø—Ä–æ —Ü–µ–π —Å–∞–π—Ç ...&quot; (—Ä–∏—Å.2).</p>\r\n\r\n<p><img alt=\"\" src=\"https://cnap.odessa.gov.ua/auth/integr1.png\" style=\"height:205px; margin-left:auto; margin-right:auto; width:413px\" /></p>\r\n\r\n<p>–†–∏—Å—É–Ω–æ–∫ 2 - Firefox –≤—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ —Å–∞–π—Ç</p>\r\n\r\n<p>–ù–∞—Ç–∏—Å–Ω—É—Ç–∏ &quot;–ü–µ—Ä–µ–≥–ª—è–Ω—É—Ç–∏ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç&quot; (—Ä–∏—Å. 3).</p>\r\n\r\n<p><img alt=\"\" src=\"https://cnap.odessa.gov.ua/auth/integr2.png\" style=\"height:428px; margin-left:auto; margin-right:auto; width:658px\" /></p>\r\n\r\n<p>–†–∏—Å—É–Ω–æ–∫ 3 - Firefox –≤—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ —Å–∞–π—Ç</p>\r\n\r\n<p>–±—Ä–∞—É–∑–µ—Ä—ñ Internet Explorer &ndash; –Ω–∞—Ç–∏—Å–Ω—É—Ç–∏ –∑–Ω–∞—á–æ–∫ &quot;–ó–∞–º–æ—á–æ–∫&quot; —Ç–∞ &quot;–ü—Ä–æ—Å–º–æ—Ç—Ä —Å–µ—Ä—Ç–∏—Ñ–∏–∫–∞—Ç–æ–≤&quot; (—Ä–∏—Å. 4).</p>\r\n\r\n<p><img alt=\"\" src=\"https://cnap.odessa.gov.ua/auth/integr4.png\" style=\"height:269px; margin-left:auto; margin-right:auto; width:290px\" /></p>\r\n\r\n<p>–†–∏—Å—É–Ω–æ–∫ 4 - Internet Explorer –≤—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ —Å–∞–π—Ç</p>\r\n\r\n<p>–±—Ä–∞—É–∑–µ—Ä—ñ Google Chrome &ndash; –Ω–∞—Ç–∏—Å–Ω—É—Ç–∏ –∑–Ω–∞—á–æ–∫ &quot;–ó–∞–º–æ—á–æ–∫&quot; —Ç–∞ &quot;–ò–Ω—Ñ–æ—Ä–º–∞—Ü–∏—è —Å–µ—Ä—Ç–∏—Ñ–∏–∫–∞—Ç–∞&quot; (—Ä–∏—Å.5).</p>\r\n\r\n<p><img alt=\"\" src=\"https://cnap.odessa.gov.ua/auth/integr3.png\" style=\"height:503px; margin-left:auto; margin-right:auto; width:373px\" /></p>\r\n\r\n<p>–†–∏—Å—É–Ω–æ–∫ 5 - Google Chrome –≤—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ —Å–∞–π—Ç</p>\r\n\r\n<p>–û—Ç—Ä–∏–º–∞—Ç–∏ –≤–º—ñ—Å—Ç –∑–∞–≤–∞–Ω—Ç–∞–∂–µ–Ω–æ–≥–æ –ø—ñ–¥–ø–∏—Å–∞–Ω–æ–≥–æ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—É —É –æ–ø–µ—Ä–∞—Ü—ñ–π–Ω—ñ–π —Å–∏—Å—Ç–µ–º—ñ Windows –º–æ–∂–Ω–∞ –Ω–∞—Ç–∏—Å–Ω—É–≤ –Ω–∞ —Ñ–∞–π–ª —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—É cnap.odessa.gov.ua.crt –ø—Ä–∞–≤–æ—é –∫–Ω–æ–ø–∫–æ—é –º–∏—à—ñ —Ç–∞ –æ–±—Ä–∞—Ç–∏ –≤–∞—Ä—ñ–∞–Ω—Ç &quot;–û—Ç–∫—Ä—ã—Ç—å&quot; (—Ä–∏—Å. 6).</p>\r\n\r\n<p><img alt=\"\" src=\"https://cnap.odessa.gov.ua/auth/integr6.png\" style=\"height:376px; margin-left:auto; margin-right:auto; width:490px\" /></p>\r\n\r\n<p>–†–∏—Å—É–Ω–æ–∫ 6 - –í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç –ø–æ—Ä—Ç–∞–ª—É —É Windows</p>\r\n\r\n<p>–ü–µ—Ä–µ–≤—ñ—Ä–∏—Ç–∏ –∑–∞ —Ä—è–¥–∫–∞–º–∏ –≤–º—ñ—Å—Ç –ø—ñ–¥–ø–∏—Å–∞–Ω–æ–≥–æ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—É –∑ –∞—Ä—Ö—ñ–≤—É —Ç–∞ –≤–º—ñ—Å—Ç —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—É —Å–∞–π—Ç—É, —è–∫–∏–π –≤—ñ–¥–æ–±—Ä–∞–∂–∞—î—Ç—å—Å—è —É –≤–µ–±-–±—Ä–∞—É–∑–µ—Ä—ñ. –Ø–∫—â–æ –ø–æ–ª—è —É —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞—Ö —ñ–¥–µ–Ω—Ç–∏—á–Ω—ñ, –º–æ–∂–Ω–∞ —Ä–æ–∑–ø–æ—á–∏–Ω–∞—Ç–∏ –ø—Ä–æ—Ü–µ—Å —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –∞–±–æ –∞–≤—Ç–æ—Ä–∏–∑–∞—Ü—ñ—ó.</p>\r\n','http://',8),(2,'2014-08-26','–û–ø–∏—Å –ø—Ä–æ—Ü–µ—Å—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –Ω–∞ –ø–æ—Ä—Ç–∞–ª—ñ ','–ü–µ—Ä—à, –Ω—ñ–∂ —Ä–æ–∑–ø–æ—á–∞—Ç–∏ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é –Ω–∞ –ø–æ—Ä—Ç–∞–ª—ñ, –∫–æ—Ä–∏—Å—Ç—É–≤–∞—á –ø–æ–≤–∏–Ω–µ–Ω –æ—Ç—Ä–∏–º–∞—Ç–∏ —É –∞–∫—Ä–µ–¥–∏—Ç–æ–≤–∞–Ω–æ–º—É —Ü–µ–Ω—Ç—Ä—ñ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ü—ñ—ó –∫–ª—é—á—ñ–≤ –≤—ñ–¥–∫—Ä–∏—Ç–∏–π —Ç–∞ –æ—Å–æ–±–∏—Å—Ç–∏–π –∫–ª—é—á –¥–ª—è —Ä–µ–∞–ª—ñ–∑–∞—Ü—ñ—ó –∫—Ä–∏–ø—Ç–æ–≥—Ä–∞—Ñ—ñ—á–Ω–∏—Ö –ø–µ—Ä–µ—Ç–≤–æ—Ä–µ–Ω—å (–ø—ã–¥–ø–∏—Å–∞–Ω–Ω—è —Ç–∞ —à–∏—Ñ—Ä—É–≤–∞–Ω–Ω—è –∑–∞—è–≤–∏). <a href=\"https://cnap.odessa.gov.ua/info/ecp/\">–î–µ—Ç–∞–ª—ñ</a>.','<p>–ü–µ—Ä—à, –Ω—ñ–∂ —Ä–æ–∑–ø–æ—á–∞—Ç–∏ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é –Ω–∞ –ø–æ—Ä—Ç–∞–ª—ñ, –∫–æ—Ä–∏—Å—Ç—É–≤–∞—á –ø–æ–≤–∏–Ω–µ–Ω –æ—Ç—Ä–∏–º–∞—Ç–∏ —É –∞–∫—Ä–µ–¥–∏—Ç–æ–≤–∞–Ω–æ–º—É —Ü–µ–Ω—Ç—Ä—ñ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ü—ñ—ó –∫–ª—é—á—ñ–≤ –≤—ñ–¥–∫—Ä–∏—Ç–∏–π —Ç–∞ –æ—Å–æ–±–∏—Å—Ç–∏–π –∫–ª—é—á –¥–ª—è —Ä–µ–∞–ª—ñ–∑–∞—Ü—ñ—ó –∫—Ä–∏–ø—Ç–æ–≥—Ä–∞—Ñ—ñ—á–Ω–∏—Ö –ø–µ—Ä–µ—Ç–≤–æ—Ä–µ–Ω—å (–ø—ã–¥–ø–∏—Å–∞–Ω–Ω—è —Ç–∞ —à–∏—Ñ—Ä—É–≤–∞–Ω–Ω—è –∑–∞—è–≤–∏). <a href=\"https://cnap.odessa.gov.ua/info/ecp/\">–î–µ—Ç–∞–ª—ñ</a>.</p>\r\n\r\n<p>–ë–µ–∑–ø–æ—Å–µ—Ä–µ–¥–Ω—å–æ –ø—Ä–æ—Ü–µ—Å —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –Ω–∞ –ø–æ—Ä—Ç–∞–ª—ñ —Å–∫–ª–∞–¥–∞—î—Ç—å—Å—è –∑ –ø&rsquo;—è—Ç–∏ –∫—Ä–æ–∫—ñ–≤:</p>\r\n\r\n<p><strong>–ö—Ä–æ–∫ 1. –Ü–Ω—ñ—Ü—ñ–∞–ª—ñ–∑–∞—Ü—ñ—è –ø—Ä–æ–≥—Ä–∞–º–Ω–æ–≥–æ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è</strong></p>\r\n\r\n<p>–î–ª—è –ø—Ä–æ—Ö–æ–¥–∂–µ–Ω–Ω—è –ø—Ä–æ—Ü–µ—Å—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –Ω–∞ –ø–æ—Ä—Ç–∞–ª—ñ –Ω–µ–æ–±—Ö—ñ–¥–Ω–æ –ø–µ—Ä–µ–π—Ç–∏ –∑–∞ –ø–æ—Å–∏–ª–∞–Ω–Ω—è–º <a href=\"https://cnap.odessa.gov.ua/users/registrate/\">https://cnap.odessa.gov.ua/users/registrate/</a>.</p>\r\n\r\n<p>–ù–∞ –¥–∞–Ω–æ–º—É –∫—Ä–æ—Ü—ñ –≤—ñ–¥–±—É–≤–∞—î—Ç—å—Å—è –ø–µ—Ä–µ–≤—ñ—Ä–∫–∞ –≤—Å—ñ—Ö –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö —É–º–æ–≤ –¥–ª—è –∫–æ—Ä–µ–∫—Ç–Ω–æ–≥–æ —Ñ—É–Ω–∫—Ü—ñ–æ–Ω—É–≤–∞–Ω–Ω—è –º–æ–¥—É–ª—ñ–≤ –ø–æ—Ä—Ç–∞–ª—É, –∞ —Å–∞–º–µ: —á–∏ –≤–∫–ª—é—á–µ–Ω–∏–π —É –±—Ä–∞—É–∑–µ