Å–∏;</p>\r\n\r\n<p>- –≤—ñ–¥—Å—É—Ç–Ω—î –ø–æ–≥–æ–¥–∂–µ–Ω–Ω—è —Å—É–º—ñ–∂–Ω–∏—Ö –∑–µ–º–ª–µ–∫–æ—Ä–∏—Å—Ç—É–≤–∞—á—ñ–≤;</p>\r\n\r\n<p>- –Ω–∞ –∑–µ–º–µ–ª—å–Ω—ñ–π –¥—ñ–ª—è–Ω—Ü—ñ, —Ä–æ–∑—Ç–∞—à–æ–≤–∞–Ω—ñ —Å–∞–º–æ–≤—ñ–ª—å–Ω–æ –∑–±—É–¥–æ–≤–∞–Ω—ñ –±—É–¥—ñ–≤–ª—ñ, –Ω–∞ —è–∫—ñ –Ω–µ –æ—Ñ–æ—Ä–º–ª–µ–Ω–∞ –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ—è –ø—Ä–æ –≤–≤–µ–¥–µ–Ω–Ω—è –≤ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—é;</p>\r\n\r\n<p>- –≤—ñ–¥—Å—É—Ç–Ω—è —Ñ–æ—Ç–æ—Ñ—ñ–∫—Å–∞—Ü—ñ—è –æ–±&rsquo;—î–∫—Ç—É;</p>\r\n\r\n<p>- –æ–±&rsquo;—î–∫—Ç, —Ä–æ–∑—Ç–∞—à–æ–≤–∞–Ω–∏–π –Ω–∞ –∑–µ–º–µ–ª—å–Ω—ñ–π –¥—ñ–ª—è–Ω—Ü—ñ, –∑–Ω–∞—Ö–æ–¥–∏—Ç—å—Å—è –≤ –Ω–µ–µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ–π–Ω–æ–º—É —Å—Ç–∞–Ω—ñ —ñ –ø–æ—Ç—Ä–µ–±—É—î —Ä–æ–∑—Ä–æ–±–∫–∏ –ø—Ä–æ–µ–∫—Ç–Ω–æ - –∫–æ—à—Ç–æ—Ä–∏—Å–Ω–æ—ó –¥–æ–∫—É–º–µ–Ω—Ç–∞—Ü—ñ—ó;</p>\r\n\r\n<p>- –ø—Ä–æ–µ–∫—Ç –∑–µ–º–ª–µ—É—Å—Ç—Ä–æ—é —Ä–æ–∑—Ä–æ–±–ª–µ–Ω–∏–π –∑ –≤—ñ–¥—Ö–∏–ª–µ–Ω–Ω—è–º–∏ –≤—ñ–¥ –ø–æ–≥–æ–¥–∂–µ–Ω–∏—Ö –£–ê–ú –º–µ–∂ –∑–µ–º–µ–ª—å–Ω–æ—ó –¥—ñ–ª—è–Ω–∫–∏;</p>\r\n\r\n<p>-&nbsp; –Ω–µ –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∞ –ø–ª–æ—â–∞ –¥—ñ—ó —Å–µ—Ä–≤—ñ—Ç—É—Ç—ñ–≤;</p>\r\n\r\n<p>-&nbsp; –∑–µ–º–µ–ª—å–Ω–∞ –¥—ñ–ª—è–Ω–∫–∞ –≤–∏–∫–æ—Ä–∏—Å—Ç–æ–≤—É—î—Ç—å—Å—è –Ω–µ –ø–æ —Ü—ñ–ª—å–æ–≤–æ–º—É –ø—Ä–∏–∑–Ω–∞—á–µ–Ω–Ω—é;</p>\r\n\r\n<p>-&nbsp; –Ω–∞ –∑–µ–º–µ–ª—å–Ω—ñ–π –¥—ñ–ª—è–Ω—Ü—ñ —Ä–æ–∑—Ç–∞—à–æ–≤–∞–Ω—ñ –æ–±&rsquo;—î–∫—Ç–∏, —Ü—ñ–ª—å–æ–≤–µ –ø—Ä–∏–∑–Ω–∞—á–µ–Ω–Ω—è —è–∫–∏—Ö –Ω–µ –≤–∏–∑–Ω–∞—á–µ–Ω–æ;</p>\r\n\r\n<p>- &nbsp;–ø–ª–æ—â–∞ –∑–µ–º–µ–ª—å–Ω–æ—ó –¥—ñ–ª—è–Ω–∫–∏ –Ω–µ –æ–±“ë—Ä—É–Ω—Ç–æ–≤–∞–Ω–∞ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–æ—é –ø—Ä–æ–µ–∫—Ç–Ω–æ—é –∞–±–æ –º—ñ—Å—Ç–æ–±—É–¥—ñ–≤–Ω–æ—é –¥–æ–∫—É–º–µ–Ω—Ç–∞—Ü—ñ—î—é;</p>\r\n\r\n<p>- —è–∫—â–æ –ø–æ–ø–µ—Ä–µ–¥–Ω—ñ–π –≤–∏—Å–Ω–æ–≤–æ–∫ –£–ê–ú –≤—Ç—Ä–∞—Ç–∏–≤ —á–∏–Ω–Ω—ñ—Å—Ç—å</p>\r\n','<p>–í–∏—Å–Ω–æ–≤–æ–∫</p>\r\n','<p>–ß–µ—Ä–µ–∑ –¶–µ–Ω—Ç—Ä –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥ –û–¥–µ—Å—å–∫–æ—ó –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏</p>\r\n','–Ω—ñ',0,NULL,0,NULL,NULL,NULL,NULL),(4,'–î–µ—Ä–∂–∞–≤–Ω–∞ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—è —ñ–Ω–æ–∑–µ–º–Ω–∏—Ö —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π',1,5,'<ul>\r\n	<li>–ß–∞—Å—Ç–∏–Ω–∞ –¥—Ä—É–≥–∞ —Å—Ç–∞—Ç—Ç—ñ 13 –ó–∞–∫–æ–Ω—É –£–∫—Ä–∞—ó–Ω–∏ &ldquo;–ü—Ä–æ —Ä–µ–∂–∏–º —ñ–Ω–æ–∑–µ–º–Ω–æ–≥–æ —ñ–Ω–≤–µ—Å—Ç—É–≤–∞–Ω–Ω—è&rdquo;</li>\r\n	<li>–ü–æ—Å—Ç–∞–Ω–æ–≤–∞ –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 6 –±–µ—Ä–µ–∑–Ω—è 2013 —Ä. ‚Ññ 139 –ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è –ü–æ—Ä—è–¥–∫—É –¥–µ—Ä–∂–∞–≤–Ω–æ—ó —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó (–ø–µ—Ä–µ—Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó) —ñ–Ω–æ–∑–µ–º–Ω–∏—Ö —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π —Ç–∞ —ó—ó –∞–Ω—É–ª—é–≤–∞–Ω–Ω—è</li>\r\n</ul>\r\n','<p>–ó–¥—ñ–π—Å–Ω–µ–Ω–Ω—è —ñ–Ω–æ–∑–µ–º–Ω–æ—ó —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ—ó</p>\r\n','<p>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞—é—Ç—å—Å—è —ñ–Ω–æ–∑–µ–º–Ω–∏–º —ñ–Ω–≤–µ—Å—Ç–æ—Ä–æ–º –∞–±–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–æ—é –Ω–∏–º –≤ —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–º—É –ø–æ—Ä—è–¥–∫—É –æ—Å–æ–±–æ—é –¥–æ —Ü–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥</p>\r\n','<ol>\r\n	<li>–Ü–Ω—Ñ–æ—Ä–º–∞—Ü—ñ–π–Ω–µ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è –∑–≥—ñ–¥–Ω–æ –∑ <a href=\"http://zakon3.rada.gov.ua/laws/show/139-2013-%D0%BF#n68\">–¥–æ–¥–∞—Ç–∫–æ–º 1</a> –¥–æ –ü–æ—Ä—è–¥–∫—É –¥–µ—Ä–∂–∞–≤–Ω–æ—ó —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó (–ø–µ—Ä–µ—Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó) —ñ–Ω–æ–∑–µ–º–Ω–∏—Ö —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π —Ç–∞ —ó—ó –∞–Ω—É–ª—é–≤–∞–Ω–Ω—è —É —Ç—Ä—å–æ—Ö –ø—Ä–∏–º—ñ—Ä–Ω–∏–∫–∞—Ö –∑ –≤—ñ–¥–º—ñ—Ç–∫–æ—é —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –æ—Ä–≥–∞–Ω—É –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ –¥–æ—Ö–æ–¥—ñ–≤ —ñ –∑–±–æ—Ä—ñ–≤ –∑–∞ –º—ñ—Å—Ü–µ–º –∑–¥—ñ–π—Å–Ω–µ–Ω–Ω—è —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π –ø—Ä–æ —ó—Ö —Ñ–∞–∫—Ç–∏—á–Ω–µ –∑–¥—ñ–π—Å–Ω–µ–Ω–Ω—è.</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç–∏, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—é—Ç—å —Ñ–æ—Ä–º—É –∑–¥—ñ–π—Å–Ω–µ–Ω–Ω—è —ñ–Ω–æ–∑–µ–º–Ω–∏—Ö —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π (—É—Å—Ç–∞–Ω–æ–≤—á—ñ –¥–æ–∫—É–º–µ–Ω—Ç–∏, –¥–æ–≥–æ–≤–æ—Ä–∏ (–∫–æ–Ω—Ç—Ä–∞–∫—Ç–∏) –ø—Ä–æ –≤–∏—Ä–æ–±–Ω–∏—á—É –∫–æ–æ–ø–µ—Ä–∞—Ü—ñ—é, —Å–ø—ñ–ª—å–Ω–µ –≤–∏—Ä–æ–±–Ω–∏—Ü—Ç–≤–æ —Ç–∞ —ñ–Ω—à—ñ –≤–∏–¥–∏ —Å–ø—ñ–ª—å–Ω–æ—ó —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π–Ω–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ, –∫–æ–Ω—Ü–µ—Å—ñ–π–Ω—ñ –¥–æ–≥–æ–≤–æ—Ä–∏ —Ç–æ—â–æ).</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç–∏, —è–∫—ñ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—é—Ç—å –≤–∞—Ä—Ç—ñ—Å—Ç—å —ñ–Ω–æ–∑–µ–º–Ω–∏—Ö —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π, —â–æ –≤–∏–∑–Ω–∞—á–∞—î—Ç—å—Å—è –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ —Å—Ç–∞—Ç—Ç—ñ 2 <a href=\"http://zakon3.rada.gov.ua/laws/show/93/96-%D0%B2%D1%80\" target=\"_blank\">–ó–∞–∫–æ–Ω—É –£–∫—Ä–∞—ó–Ω–∏ &ldquo;–ü—Ä–æ —Ä–µ–∂–∏–º —ñ–Ω–æ–∑–µ–º–Ω–æ–≥–æ —ñ–Ω–≤–µ—Å—Ç—É–≤–∞–Ω–Ω—è&rdquo;</a>.</li>\r\n</ol>\r\n\r\n<p><a href=\"/iasnap/ckeditor/kcfinder/upload/files/nf_pov_domlennya_17_05_2013.doc\">–ó–∞–≤–∞–Ω—Ç–∞–∂–∏—Ç–∏ —Ñ–æ—Ä–º—É —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ–π–Ω–æ–≥–æ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è. </a></p>\r\n',0,'','','','<p>7 –¥–Ω—ñ–≤</p>\r\n','<p>–ü–æ—Ä—É—à–µ–Ω–Ω—è –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–≥–æ –ø–æ—Ä—è–¥–∫—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó</p>\r\n','<p>–î–µ—Ä–∂–∞–≤–Ω–∞ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—è —ñ–Ω–æ–∑–µ–º–Ω–æ—ó —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ—ó (—ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ–π–Ω–µ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è) –∞–±–æ –≤—ñ–¥–º–æ–≤–∞ –≤ –Ω–∞–¥–∞–Ω–Ω—ñ –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–æ—ó –ø–æ—Å–ª—É–≥–∏.</p>\r\n','<p>–ê–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∞ –ø–æ—Å–ª—É–≥–∞ –≤–≤–∞–∂–∞—î—Ç—å—Å—è –Ω–∞–¥–∞–Ω–∞ –∑ –º–æ–º–µ–Ω—Ç—É –æ—Ç—Ä–∏–º–∞–Ω–Ω—è —ó—ó —á–µ—Ä–µ–∑ –£–ø—Ä–∞–≤–ª—ñ–Ω–Ω—è –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥ –û–¥–µ—Å—å–∫–æ—ó –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏</p>\r\n','–Ω—ñ',0,NULL,0,NULL,NULL,NULL,NULL),(5,'–ü–µ—Ä–µ—Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—è —ñ–Ω–æ–∑–µ–º–Ω–∏—Ö —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π',1,5,'<p>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ —Ä–µ–∂–∏–º —ñ–Ω–æ–∑–µ–º–Ω–æ–≥–æ —ñ–Ω–≤–µ—Å—Ç—É–≤–∞–Ω–Ω—è&raquo; –ü–æ—Å—Ç–∞–Ω–æ–≤–∞ –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 6 –±–µ—Ä–µ–∑–Ω—è 2013 —Ä. ‚Ññ 139 –ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è –ü–æ—Ä—è–¥–∫—É –¥–µ—Ä–∂–∞–≤–Ω–æ—ó —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó (–ø–µ—Ä–µ—Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó) —ñ–Ω–æ–∑–µ–º–Ω–∏—Ö —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ–π —Ç–∞ —ó—ó –∞–Ω—É–ª—é–≤–∞–Ω–Ω—è.</p>\r\n','<p>---</p>\r\n','<p>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞—é—Ç—å—Å—è —ñ–Ω–æ–∑–µ–º–Ω–∏–º —ñ–Ω–≤–µ—Å—Ç–æ—Ä–æ–º –∞–±–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–æ—é –Ω–∏–º –≤ —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–º—É –ø–æ—Ä—è–¥–∫—É –æ—Å–æ–±–æ—é –¥–æ —Ü–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥</p>\r\n','<p>–ê–±–æ:</p>\r\n\r\n<ul>\r\n	<li>–ø–∏—Å—å–º–æ–≤–µ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è –ø—Ä–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —ñ–Ω–æ–∑–µ–º–Ω–∏–º —ñ–Ω–≤–µ—Å—Ç–æ—Ä–æ–º —Å–≤–æ—î—ó –¥—ñ—