p; ‚Ññ&nbsp;987-–•–Ü–Ü (—Å—Ç–∞—Ç—Ç—è 14).&nbsp;</p>\r\n','<p>---</p>\r\n','<p>–ß–µ—Ä–µ–∑ –¶–µ–Ω—Ç—Ä –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥ –û–¥–µ—Å—å–∫–æ—ó –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏.</p>\r\n','<p>1.–ó–∞—è–≤–∞ –∑–∞—Å–Ω–æ–≤–Ω–∏–∫—ñ–≤ (—á–ª–µ–Ω—ñ–≤) —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏ –Ω–∞ —ñ–º&rsquo;—è –≥–æ–ª–æ–≤–∏ –æ–±–ª–¥–µ—Ä–∂–∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ü—ñ—ó (–∑–∞—è–≤—É –ø—ñ–¥–ø–∏—Å—É—é—Ç—å –Ω–µ –º–µ–Ω—à–µ 10 –ø–æ–≤–Ω–æ–ª—ñ—Ç–Ω—ñ—Ö –≥—Ä–æ–º–∞–¥—è–Ω. –ü—ñ–¥–ø–∏—Å–∏ –∑–∞–≤—ñ—Ä—è—é—Ç—å—Å—è –Ω–æ—Ç–∞—Ä—ñ–∞–ª—å–Ω–æ).</p>\r\n\r\n<p>2. –°—Ç–∞—Ç—É—Ç —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏, –ø—Ä–∏–π–Ω—è—Ç–∏–π –Ω–∞ –∑–∞–≥–∞–ª—å–Ω–∏—Ö –∑–±–æ—Ä–∞—Ö –≤—ñ—Ä—É—é—á–∏—Ö –≥—Ä–æ–º–∞–¥—è–Ω (–ø—Ä–æ—à–∏—Ç—ñ, 5 –ø—Ä–∏–º—ñ—Ä–Ω–∏–∫—ñ–≤).</p>\r\n\r\n<p>3. –î–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –º—ñ—Å—Ü–µ–∑–Ω–∞—Ö–æ–¥–∂–µ–Ω–Ω—è —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏ (–ø—ñ–¥–ø–∏—Å –∑–∞–≤—ñ—Ä—è—î—Ç—å—Å—è –Ω–æ—Ç–∞—Ä—ñ–∞–ª—å–Ω–æ).</p>\r\n\r\n<p>4. –ü—Ä–æ—Ç–æ–∫–æ–ª —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö (–∑–∞–≥–∞–ª—å–Ω–∏—Ö) –∑–±–æ—Ä—ñ–≤ –≤—ñ—Ä—É—é—á–∏—Ö –≥—Ä–æ–º–∞–¥—è–Ω ( 2 –ø—Ä–∏–º—ñ—Ä–Ω–∏–∫–∞).</p>\r\n\r\n<p>5. –û—Ä–∏–≥—ñ–Ω–∞–ª–∏ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π–Ω–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏ (—É —Ä–∞–∑—ñ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó —Å—Ç–∞—Ç—É—Ç—É —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏ —É –Ω–æ–≤–æ—ó —Ä–µ–¥–∞–∫—Ü—ñ—ó).</p>\r\n\r\n<p>–í—Å—ñ –¥–æ–∫—É–º–µ–Ω—Ç–∏ –æ—Ñ–æ—Ä–º–ª—è—é—Ç—å—Å—è –¥–µ—Ä–∂–∞–≤–Ω–æ—é –º–æ–≤–æ—é.</p>\r\n\r\n<p>–°—Ç–∞—Ç—É—Ç –Ω–µ –ø–æ–≤–∏–Ω–µ–Ω —Å—É–ø–µ—Ä–µ—á–∏—Ç–∏ —á–∏–Ω–Ω–æ–º—É –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤—É.</p>\r\n\r\n<p><a href=\"–ó–∞–≤–∞–Ω—Ç–∞–∂–∏—Ç–∏ –∑—Ä–∞–∑–æ–∫ –∑–∞—è–≤–∏ –ø—Ä–æ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —Å—Ç–∞—Ç—É—Ç—É —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏\">–ó–∞–≤–∞–Ω—Ç–∞–∂–∏—Ç–∏ –∑—Ä–∞–∑–æ–∫ –∑–∞—è–≤–∏ –ø—Ä–æ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —Å—Ç–∞—Ç—É—Ç—É —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏</a>&nbsp;</p>\r\n',0,'','','','<p>–í—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ —Å—Ç–∞—Ç—Ç—ñ 14 –ó–∞–∫–æ–Ω—É –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ —Å–≤–æ–±–æ–¥—É —Å–æ–≤—ñ—Å—Ç—ñ —Ç–∞ —Ä–µ–ª—ñ–≥—ñ–π–Ω—ñ –æ—Ä–≥–∞–Ω—ñ–∑–∞—Ü—ñ—ó&raquo; –æ–±–ª–∞—Å–Ω–∞ –¥–µ—Ä–∂–∞–≤–Ω–∞ –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ü—ñ—è –≤ –º—ñ—Å—è—á–Ω–∏–π —Ç–µ—Ä–º—ñ–Ω —Ä–æ–∑–≥–ª—è–¥–∞—î –∑–∞—è–≤—É, —Å—Ç–∞—Ç—É—Ç (–ø–æ–ª–æ–∂–µ–Ω–Ω—è) —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏, –ø—Ä–∏–π–º–∞—î –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–µ —Ä—ñ—à–µ–Ω–Ω—è&nbsp; —ñ –Ω–µ –ø—ñ–∑–Ω—ñ—à —è–∫ —É –¥–µ—Å—è—Ç–∏–¥–µ–Ω–Ω–∏–π —Ç–µ—Ä–º—ñ–Ω –ø–∏—Å—å–º–æ–≤–æ –ø–æ–≤—ñ–¥–æ–º–ª—è—î –ø—Ä–æ –Ω—å–æ–≥–æ –∑–∞—è–≤–Ω–∏–∫–∞–º. –£ –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö –≤–∏–ø–∞–¥–∫–∞—Ö –æ–±–ª–¥–µ—Ä–∂–∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ü—ñ—è –º–æ–∂–µ –∑–∞–∂–∞–¥–∞—Ç–∏ –≤–∏—Å–Ω–æ–≤–æ–∫ –º—ñ—Å—Ü–µ–≤–æ—ó –¥–µ—Ä–∂–∞–≤–Ω–æ—ó –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ü—ñ—ó, –≤–∏–∫–æ–Ω–∞–≤—á–æ–≥–æ –∫–æ–º—ñ—Ç–µ—Ç—É —Å—ñ–ª—å—Å—å–∫–æ—ó, —Å–µ–ª–∏—â–Ω–æ—ó, –º—ñ—Å—å–∫–æ—ó –†–∞–¥ –Ω–∞—Ä–æ–¥–Ω–∏—Ö –¥–µ–ø—É—Ç–∞—Ç—ñ–≤, –∞ —Ç–∞–∫–æ–∂ —Å–ø–µ—Ü—ñ–∞–ª—ñ—Å—Ç—ñ–≤. –£ —Ü—å–æ–º—É —Ä–∞–∑—ñ —Ä—ñ—à–µ–Ω–Ω—è –ø—Ä–∏–π–º–∞—î—Ç—å—Å—è —É —Ç—Ä–∏–º—ñ—Å—è—á–Ω–∏–π —Ç–µ—Ä–º—ñ–Ω.</p>\r\n','<p>---</p>\r\n','<p><strong>–†–æ–∑–ø–æ—Ä—è–¥–∂–µ–Ω–Ω—è –≥–æ–ª–æ–≤–∏ –æ–±–ª–∞—Å–Ω–æ—ó –¥–µ—Ä–∂–∞–≤–Ω–æ—ó –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ü—ñ—ó; —Ä—ñ—à–µ–Ω–Ω—è –ø—Ä–æ –≤—ñ–¥–º–æ–≤—É –≤ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—è—Ö —Å—Ç–∞—Ç—É—Ç—É (–ø–æ–ª–æ–∂–µ–Ω–Ω—è) —Ä–µ–ª—ñ–≥—ñ–π–Ω–æ—ó –≥—Ä–æ–º–∞–¥–∏ —ñ–∑ –∑–∞–∑–Ω–∞—á–µ–Ω–Ω—è–º –ø—ñ–¥—Å—Ç–∞–≤ –≤—ñ–¥–º–æ–≤–∏.</strong></p>\r\n','<p>–ß–µ—Ä–µ–∑ –¶–µ–Ω—Ç—Ä –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥ –û–¥–µ—Å—å–∫–æ—ó –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏.</p>\r\n','–Ω—ñ',0,NULL,0,NULL,NULL,NULL,NULL),(10,'–î–æ–∑–≤—ñ–ª –Ω–∞ –≤–∏–∫–∏–¥–∏ –∑–∞–±—Ä—É–¥–Ω—é—é—á–∏—Ö —Ä–µ—á–æ–≤–∏–Ω –≤ –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–µ –ø–æ–≤—ñ—Ç—Ä—è —Å—Ç–∞—Ü—ñ–æ–Ω–∞—Ä–Ω–∏–º–∏ –¥–∂–µ—Ä–µ–ª–∞–º–∏ (–¥–ª—è –æ–±‚Äô—î–∫—Ç—ñ–≤ –¥—Ä—É–≥–æ—ó —Ç–∞ —Ç—Ä–µ—Ç—å–æ—ó –≥—Ä—É–ø)',1,7,'<ul>\r\n	<li>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ &quot;–ü—Ä–æ –ü–µ—Ä–µ–ª—ñ–∫ –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –¥–æ–∑–≤—ñ–ª—å–Ω–æ–≥–æ —Ö–∞—Ä–∞–∫—Ç–µ—Ä—É —É —Å—Ñ–µ—Ä—ñ –≥–æ—Å–ø–æ–¥–∞—Ä—Å—å–∫–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ&quot; (–ø. 30) ;</li>\r\n	<li>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ &quot;–ü—Ä–æ –æ—Ö–æ—Ä–æ–Ω—É –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–æ–≥–æ –ø–æ–≤—ñ—Ç—Ä—è&quot; (—Å—Ç. 11).</li>\r\n</ul>\r\n','<p>–ó–¥—ñ–π—Å–Ω–µ–Ω–Ω—è –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ –ø–æ–≤&rsquo;—è–∑–∞–Ω–æ—ó –∑ –≤–∏–∫–∏–¥–∞–º–∏ –≤ –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–µ –ø–æ–≤—ñ—Ç—Ä—è</p>\r\n','<p>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞—é—Ç—å—Å—è —á–µ—Ä–µ–∑ –¶–µ–Ω—Ç—Ä –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥ –û–¥–µ—Å—å–∫–æ—ó –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏ —Å—É–±&#39;—î–∫—Ç–æ–º –≥–æ—Å–ø–æ–¥–∞—Ä—é–≤–∞–Ω–Ω—è (–∫–µ—Ä—ñ–≤–Ω–∏–∫–æ–º —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏, —Ñ—ñ–∑–∏—á–Ω–æ—é –æ—Å–æ–±–æ—é - –ø—ñ–¥–ø—Ä–∏—î–º—Ü–µ–º) –∞–±–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–æ—é –æ—Å–æ–±–æ—é. –£–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–∞ –æ—Å–æ–±–∞ –ø–æ–≤–∏–Ω–Ω–∞ –º–∞—Ç–∏ –¥–æ–∫—É–º–µ–Ω—Ç, —è–∫–∏–π –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î —ó—ó –ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–Ω—è.&nbsp;</p>\r\n','<ol>\r\n	<li>–ó–∞—è–≤–∞ (–Ω–∞–∫–∞–∑ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ –æ—Ö–æ—Ä–æ–Ω–∏ –Ω–∞–≤–∫–æ–ª–∏—à–Ω—å–æ–≥–æ –ø—Ä–∏—Ä–æ–¥–Ω–æ–≥–æ —Å–µ—Ä–µ–¥–æ–≤–∏—â–∞ –£–∫—Ä–∞—ó–Ω–∏ 30.05.2006 ‚Ññ 266)</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç–∏, –≤ —è–∫–∏—Ö –æ–±“ë—Ä—É–Ω—Ç–æ–≤—É—é—Ç—å—Å—è –æ–±—Å—è–≥–∏ –≤–∏–∫–∏–¥—ñ–≤ –∑–∞–±—Ä—É–¥–Ω—é—é—á–∏—Ö —Ä–µ—á–æ–≤–∏–Ω (–≤ –ø–∏—Å—å–º–æ–≤—ñ–π —Ç–∞ –≤ –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω—ñ–π —Ñ–æ—Ä–º—ñ XML-—Ñ–∞–π–ª–∏);</li>\r\n	<li>–ó–≤—ñ—Ç –∑ —ñ–Ω–≤–µ–Ω—Ç–∞—Ä–∏–∑–∞—Ü—ñ—ó —Å—Ç–∞—Ü—ñ–æ–Ω–∞—Ä–Ω–∏—Ö –¥–∂–µ—Ä–µ–ª –≤–∏–∫–∏–¥—ñ–≤ –∑–∞–±—Ä—É–¥–Ω—é—é—á–∏—Ö —Ä–µ—á–æ–≤–∏–Ω –≤ –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–µ –ø–æ–≤—ñ—Ç—Ä—è, –≤–∏–¥—ñ–≤ —Ç–∞ –æ–±—Å—è–≥—ñ–≤ –≤–∏–∫–∏–¥—ñ–≤ –∑–∞–±—Ä—É–¥–Ω—é—é—á–∏—Ö —Ä–µ—á–æ–≤–∏–Ω –≤ –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–µ –ø–æ–≤—ñ—Ç—Ä—è —Å—Ç–∞—Ü—ñ–æ–Ω–∞—Ä–Ω–∏–º–∏&nbsp; –¥–∂–µ—Ä–µ–ª–∞–º–∏, –ø–∏–ª–æ–≥–∞–∑–æ–æ—á–∏—Å–Ω–æ–≥–æ –æ–±–ª–∞–¥–Ω–∞–Ω–Ω—è;</li>\r\n	<li>–û—Ü—ñ–Ω–∫–∞ –≤–ø–ª–∏–≤—É –≤–∏–∫–∏–¥—ñ–≤ –∑–∞–±—Ä—É–¥–Ω—é—é—á–∏—Ö —Ä–µ—á–æ–≤–∏–Ω –Ω–∞ —Å—Ç–∞–Ω –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–æ–≥–æ –ø–æ–≤—ñ—Ç—Ä—è –Ω–∞ –º–µ–∂—ñ —Å–∞–Ω—ñ—Ç–∞—Ä–Ω–æ-–∑–∞—Ö–∏—Å–Ω–æ—ó –∑–æ–Ω–∏ (—Ç—ñ–ª—å–∫–∏ –¥–ª—è —Å—É–±&rsquo;—î–∫—Ç—ñ–≤ –≥–æ—Å–ø–æ–¥–∞—Ä—é–≤–∞–Ω–Ω—è, –æ–±&rsquo;—î–∫—Ç–∏ —è–∫–∏—Ö –Ω–∞–ª–µ–∂–∞—Ç—å –¥–æ 2 –≥—Ä—É–ø–∏).</li>\r\n	<li>–ü–ª–∞–Ω–∏ –∑–∞—Ö–æ–¥—ñ–≤ (—Ç—ñ–ª—å–∫–∏ –¥–ª—è —Å—É–±&rsquo;—î–∫—Ç—ñ–≤ –≥–æ—Å–ø–æ–¥–∞—Ä—é–≤–∞–Ω–Ω—è, –æ–±&rsquo;—î–∫—Ç–∏ —è–∫–∏—Ö –Ω–∞–ª–µ–∂–∞—Ç—å –¥–æ 2 –≥—Ä—É–ø–∏) —â–æ–¥–æ:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>–¥–æ—Å—è–≥–Ω–µ–Ω–Ω—è –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏—Ö –Ω–æ—Ä–º–∞—Ç–∏–≤—ñ–≤ –≥—Ä–∞–Ω–∏—á–Ω–æ–¥–æ–ø—É—Å—Ç–∏–º–∏—Ö –≤–∏–∫–∏–¥—ñ–≤ –¥–ª—è –Ω–∞–π–±—ñ–ª—å—à –ø–æ—à–∏—Ä–µ–Ω–∏—Ö —ñ –Ω–µ–±–µ–∑–ø–µ—á–Ω–∏—Ö –∑–∞–±—Ä—É–¥–Ω—é—é—á–∏—Ö —Ä–µ—á–æ–≤–∏–Ω;</li>\r\n	<li>–æ—Ö–æ—Ä–æ–Ω–∏ –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–æ–≥–æ –ø–æ–≤—ñ—Ç—Ä—è –Ω–∞ –≤–∏–ø–∞–¥–æ–∫ –≤–∏–Ω–∏–∫–Ω–µ–Ω–Ω—è –Ω–∞–¥–∑–≤–∏—á–∞–π–Ω–∏—Ö —Å–∏—Ç—É–∞—Ü—ñ–π —Ç–µ—Ö–Ω–æ–≥–µ–Ω–Ω–æ–≥–æ —Ç–∞ –ø—Ä–∏—Ä–æ–¥–Ω–æ–≥–æ —Ö–∞—Ä–∞–∫—Ç–µ—Ä—É;</li>\r\n	<li>–ª—ñ–∫–≤—ñ–¥–∞—Ü—ñ—ó –ø—Ä–∏—á–∏–Ω —ñ –Ω–∞—Å–ª—ñ–¥–∫—ñ–≤ –∑–∞–±—Ä—É–¥–Ω–µ–Ω–Ω—è –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–æ–≥–æ –ø–æ–≤—ñ—Ç—Ä—è;</li>\r\n	<li>–æ—Å—Ç–∞—Ç–æ—á–Ω–æ–≥–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ, –ø–æ–≤&#39;—è–∑–∞–Ω–æ—ó –∑ –≤–∏–∫–∏–¥–∞–º–∏ –∑–∞–±—Ä—É–¥–Ω—é—é—á–∏—Ö —Ä–µ—á–æ–≤–∏–Ω –≤ –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–µ –ø–æ–≤—ñ—Ç—Ä—è, —Ç–∞ –ø—Ä–∏–≤–µ–¥–µ–Ω–Ω—è –º—ñ—Å—Ü—è –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ —É –∑–∞–¥–æ–≤—ñ–ª—å–Ω–∏–π —Å—Ç–∞–Ω;</li>\r\n	<li>–∑–∞–ø–æ–±—ñ–≥–∞–Ω–Ω—è –ø–µ—Ä–µ–≤–∏—â–µ–Ω–Ω—é –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏—Ö –Ω–æ—Ä–º–∞—Ç–∏–≤—ñ–≤ –≥—Ä–∞–Ω–∏—á–Ω–æ–¥–æ–ø—É—Å—Ç–∏–º–∏—Ö –≤–∏–∫–∏–¥—ñ–≤ —É –ø—Ä–æ—Ü–µ—Å—ñ –≤–∏—Ä–æ–±–Ω–∏—Ü—Ç–≤–∞;</li>\r\n	<li>–∑–¥—ñ–π—Å–Ω–µ–Ω–Ω—è –∫–æ–Ω—Ç—Ä–æ–ª—é –∑–∞ –¥–æ—Ç—Ä–∏–º–∞–Ω–Ω—è–º –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏—Ö –Ω–æ—Ä–º–∞—Ç–∏–≤—ñ–≤ –≥—Ä–∞–Ω–∏—á–Ω–æ–¥–æ–ø—É—Å—Ç–∏–º–∏—Ö –≤–∏–∫–∏–¥—ñ–≤ –∑–∞–±—Ä—É–¥–Ω—é—é—á–∏—Ö —Ä–µ—á–æ–≤–∏–Ω —Ç–∞ —É–º–æ–≤ –¥–æ–∑–≤–æ–ª—É –Ω–∞ –≤–∏–∫–∏–¥–∏.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>–û–±“ë—Ä—É–Ω—Ç—É–≤–∞–Ω–Ω—è —Ä–æ–∑–º—ñ—Ä—ñ–≤ –Ω–æ—Ä–º–∞—Ç–∏–≤–Ω–∏—Ö —Å–∞–Ω—ñ—Ç–∞—Ä–Ω–æ-–∑–∞—Ö–∏—Å–Ω–∏—Ö –∑–æ–Ω, –æ—Ü—ñ–Ω–∫–∞ –≤–∏—Ç—Ä–∞—Ç, –ø–æ–≤`—è–∑–∞–Ω–∏—Ö –∑ —Ä–µ–∞–ª—ñ–∑–∞—Ü—ñ—î—é –∑–∞—Ö–æ–¥—ñ–≤ —â–æ–¥–æ —ó—Ö —Å—Ç–≤–æ—Ä–µ–Ω–Ω—è.</li>\r\n	<li>–û—Ü—ñ–Ω–∫–∞ —Ç–∞ –∞–Ω–∞–ª—ñ–∑ –≤–∏—Ç—Ä–∞—Ç, –ø–æ–≤`—è–∑–∞–Ω–∏—Ö –∑ —Ä–µ–∞–ª—ñ–∑–∞—Ü—ñ—î—é –∑–∞–ø–ª–∞–Ω–æ–≤–∞–Ω–∏—Ö –∑–∞—Ö–æ–¥—ñ–≤ —â–æ–¥–æ –∑–∞–ø–æ–±—ñ–≥–∞–Ω–Ω—è –∑–∞–±—Ä—É–¥–Ω–µ–Ω–Ω—é –∞—Ç–º–æ—Å—Ñ–µ—Ä–Ω–æ–≥–æ –ø–æ–≤—ñ—Ç—Ä—è (—Ç—ñ–ª—å–∫–∏ –¥–ª—è —Å—É–±&rsquo;—î–∫—Ç—ñ–≤ –≥–æ—Å–ø–æ–¥–∞—Ä—é–≤–∞–Ω–Ω—è, –æ–±&rsquo;—î–∫—Ç–∏ —è–∫–