>\r\n','<ol>\r\n	<li>–ó–∞—è–≤–∞ –ø—Ä–æ –ø—Ä–æ–≤–µ–¥–µ–Ω–Ω—è –ª—ñ—Ü–µ–Ω–∑—É–≤–∞–Ω–Ω—è —ñ–∑ –∑–∞–∑–Ω–∞—á–µ–Ω–Ω—è–º –≤–∏–¥—É –æ—Å–≤—ñ—Ç–Ω—å–æ—ó –ø–æ—Å–ª—É–≥–∏ —ñ –ª—ñ—Ü–µ–Ω–∑–æ–≤–∞–Ω–æ–≥–æ –æ–±—Å—è–≥—É, —Ä–µ–∫–≤—ñ–∑–∏—Ç—ñ–≤ –Ω–∞–≤—á–∞–ª—å–Ω–æ–≥–æ –∑–∞–∫–ª–∞–¥—É –∑–∞ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–æ—é –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–æ–º –æ—Å–≤—ñ—Ç–∏ —ñ –Ω–∞—É–∫–∏, –º–æ–ª–æ–¥—ñ —Ç–∞ —Å–ø–æ—Ä—Ç—É –£–∫—Ä–∞—ó–Ω–∏ —Ñ–æ—Ä–º–æ—é.</li>\r\n	<li>–ö–æ–ø—ñ—ó —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ (—Å—Ç–∞—Ç—É—Ç—É, –ø–æ–ª–æ–∂–µ–Ω–Ω—è, —Ä—ñ—à–µ–Ω–Ω—è –∑–∞—Å–Ω–æ–≤–Ω–∏–∫–∞ (–≤–ª–∞—Å–Ω–∏–∫–∞) –∞–±–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–æ–≥–æ –Ω–∏–º –æ—Ä–≥–∞–Ω—É –ø—Ä–æ —Å—Ç–≤–æ—Ä–µ–Ω–Ω—è –Ω–∞–≤—á–∞–ª—å–Ω–æ–≥–æ –∑–∞–∫–ª–∞–¥—É).</li>\r\n	<li>–ö–æ–ø—ñ—ó —Ä—ñ—à–µ–Ω—å –ø—Ä–æ —É—Ç–≤–æ—Ä–µ–Ω–Ω—è –≤—ñ–¥–æ–∫—Ä–µ–º–ª–µ–Ω–∏—Ö –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—ñ–≤ —Ç–∞ –ø–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ –Ω–∏—Ö (—É —Ä–∞–∑—ñ –ª—ñ—Ü–µ–Ω–∑—É–≤–∞–Ω–Ω—è –æ—Å–≤—ñ—Ç–Ω—ñ—Ö –ø–æ—Å–ª—É–≥ —É –≤—ñ–¥–æ–∫—Ä–µ–º–ª–µ–Ω–æ–º—É –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—ñ).</li>\r\n	<li>–ö–æ–Ω—Ü–µ–ø—Ü—ñ—è –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ –∑–∞ –∑–∞—è–≤–ª–µ–Ω–æ—é –æ—Å–≤—ñ—Ç–Ω—å–æ—é –ø–æ—Å–ª—É–≥–æ—é, —è–∫–∞ “ë—Ä—É–Ω—Ç—É—î—Ç—å—Å—è –Ω–∞ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞—Ö –º–æ–Ω—ñ—Ç–æ—Ä–∏–Ω–≥—É —Ä–µ–≥—ñ–æ–Ω–∞–ª—å–Ω–æ–≥–æ —Ä–∏–Ω–∫—É –æ—Å–≤—ñ—Ç–Ω—ñ—Ö –ø–æ—Å–ª—É–≥.</li>\r\n	<li>–ö–æ–ø—ñ—è —Ä–æ–±–æ—á–æ–≥–æ –Ω–∞–≤—á–∞–ª—å–Ω–æ–≥–æ –ø–ª–∞–Ω—É, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–æ–≥–æ –≤ —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–º—É –ø–æ—Ä—è–¥–∫—É.</li>\r\n	<li>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ –∫—ñ–ª—å–∫—ñ—Å–Ω—ñ —Ç–∞ —è–∫—ñ—Å–Ω—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ –∫–∞–¥—Ä–æ–≤–æ–≥–æ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –æ—Å–≤—ñ—Ç–Ω—å–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ.</li>\r\n	<li>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ –∫—ñ–ª—å–∫—ñ—Å–Ω—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ –º–∞—Ç–µ—Ä—ñ–∞–ª—å–Ω–æ-—Ç–µ—Ö–Ω—ñ—á–Ω–æ–≥–æ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –æ—Å–≤—ñ—Ç–Ω—å–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ.</li>\r\n	<li>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ –Ω–∞–≤—á–∞–ª—å–Ω–æ-–º–µ—Ç–æ–¥–∏—á–Ω–µ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –æ—Å–≤—ñ—Ç–Ω—å–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ.</li>\r\n	<li>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ –∫—ñ–ª—å–∫—ñ—Å–Ω—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ–π–Ω–æ–≥–æ –∑–∞–±–µ–∑–ø–