–±–ª–¥–µ—Ä–∂–∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ü—ñ—ó.</li>\r\n	<li>–ö–æ–ø—ñ—è –Ω–∞–≤—á–∞–ª—å–Ω–æ–≥–æ –ø–ª–∞–Ω—É (–Ω–∞–≤—á–∞–ª—å–Ω–∏—Ö –ø–ª–∞–Ω—ñ–≤), –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–æ–≥–æ –≤ —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–º—É –ø–æ—Ä—è–¥–∫—É.</li>\r\n	<li>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ –∫—ñ–ª—å–∫—ñ—Å–Ω—ñ —Ç–∞ —è–∫—ñ—Å–Ω—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ –∫–∞–¥—Ä–æ–≤–æ–≥–æ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –æ—Å–≤—ñ—Ç–Ω—å–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ.</li>\r\n	<li>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ –∫—ñ–ª—å–∫—ñ—Å–Ω—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ –º–∞—Ç–µ—Ä—ñ–∞–ª—å–Ω–æ-—Ç–µ—Ö–Ω—ñ—á–Ω–æ–≥–æ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –æ—Å–≤—ñ—Ç–Ω—å–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ.</li>\r\n	<li>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ –Ω–∞–≤—á–∞–ª—å–Ω–æ-–º–µ—Ç–æ–¥–∏—á–Ω–µ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –æ—Å–≤—ñ—Ç–Ω—å–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ.</li>\r\n	<li>–í—ñ–¥–æ–º–æ—Å—Ç—ñ –ø—Ä–æ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ–π–Ω–µ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –æ—Å–≤—ñ—Ç–Ω—å–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ.</li>\r\n	<li>–ö–æ–ø—ñ—ó –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤, —â–æ –∑–∞—Å–≤—ñ–¥—á—É—é—Ç—å –ø—Ä–∞–≤–æ –≤–ª–∞—Å–Ω–æ—Å—Ç—ñ (—Å–≤—ñ–¥–æ—Ü—Ç–≤–æ –ø—Ä–æ –ø—Ä–∞–≤–æ –≤–ª–∞—Å–Ω–æ—Å—Ç—ñ, –¥–æ–≥–æ–≤—ñ—Ä –∫—É–ø—ñ–≤–ª—ñ-–ø—Ä–æ–¥–∞–∂—É), –æ–ø–µ—Ä–∞—Ç–∏–≤–Ω–æ–≥–æ —É–ø—Ä–∞–≤–ª—ñ–Ω–Ω—è (—Ä—ñ—à–µ–Ω–Ω—è —á–∏ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è –≤–ª–∞—Å–Ω–∏–∫–∞ –º–∞–π–Ω–∞ –ø—Ä–æ –ø–µ—Ä–µ–±—É–≤–∞–Ω–Ω—è –º–∞–π–Ω–∞ –≤ –æ–ø–µ—Ä–∞—Ç–∏–≤–Ω–æ–º—É —É–ø—Ä–∞–≤–ª—ñ–Ω–Ω—ñ) —á–∏ –∫–æ—Ä–∏—Å—Ç—É–≤–∞–Ω–Ω—è (–¥–æ–≥–æ–≤—ñ—Ä –æ—Ä–µ–Ω–¥–∏) –æ—Å–Ω–æ–≤–Ω–∏–º–∏ –∑–∞—Å–æ–±–∞–º–∏ –¥–ª—è –∑–¥—ñ–π—Å–Ω–µ–Ω–Ω—è –Ω–∞–≤—á–∞–ª—å–Ω–æ-–≤–∏—Ö–æ–≤–Ω–æ–≥–æ –ø—Ä–æ—Ü–µ—Å—É –Ω–∞ —Å—Ç—Ä–æ–∫, –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏–π –¥–ª—è –∑–∞–≤–µ—Ä—à–µ–Ω–Ω—è –Ω–∞–¥–∞–Ω–Ω—è –ø–æ—Å–ª—É–≥–∏.</li>\r\n	<li>–ö–æ–ø—ñ—ó –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –ø—Ä–æ –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω—ñ—Å—Ç—å –ø—Ä–∏–º—ñ—â–µ–Ω—å –Ω–∞–≤—á–∞–ª—å–Ω–æ–≥–æ –∑–∞–∫–ª–∞–¥—É —Ç–∞ –π–æ–≥–æ –º–∞—Ç–µ—Ä—ñ–∞–ª—å–Ω–æ-—Ç–µ—Ö–Ω—ñ—á–Ω–æ—ó –±–∞–∑–∏ —Å–∞–Ω—ñ—Ç–∞—Ä–Ω–∏–º –Ω–æ—Ä–º–∞–º, –≤–∏–º–æ–≥–∞–º –ø—Ä–∞–≤–∏–ª –ø–æ–∂–µ–∂–Ω–æ—ó –±–µ–∑–ø–µ–∫–∏.</li>\r\n	<li>–ö–æ–ø—ñ—ó –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤, —â–æ –∑–∞—Å–≤—ñ–¥—á—É—é—Ç—å —Ä—ñ–≤–µ–Ω—å –æ—Å–≤—ñ—Ç–∏, –∫–≤–∞–ª—ñ—Ñ—ñ–∫–∞—Ü—ñ—ó —Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω—Å—Ç–≤–æ –∫–µ—