ol>\r\n	<li>–õ–∏—Å—Ç-–∑–≤–µ—Ä–Ω–µ–Ω–Ω—è –ø—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é –∑–º—ñ–Ω —ñ –¥–æ–ø–æ–≤–Ω–µ–Ω—å –¥–æ –¥–æ–≥–æ–≤–æ—Ä—É (–∫–æ–Ω—Ç—Ä–∞–∫—Ç—É).</li>\r\n	<li>–Ü–Ω—Ñ–æ—Ä–º–∞—Ü—ñ–π–Ω–∞ –∫–∞—Ä—Ç–∫–∞ –¥–æ–≥–æ–≤–æ—Ä—É (–∫–æ–Ω—Ç—Ä–∞–∫—Ç—É) –∑–∞ —Ñ–æ—Ä–º–æ—é, —â–æ –≤—Å—Ç–∞–Ω–æ–≤–ª—é—î –ú—ñ–Ω–µ–∫–æ–Ω–æ–º—Ä–æ–∑–≤–∏—Ç–∫—É.</li>\r\n	<li>–î–æ–≥–æ–≤—ñ—Ä (–∫–æ–Ω—Ç—Ä–∞–∫—Ç) (–æ—Ä–∏–≥—ñ–Ω–∞–ª —ñ –∫–æ–ø—ñ—é), –∑–∞—Å–≤—ñ–¥—á–µ–Ω—ñ –≤ —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–º—É –ø–æ—Ä—è–¥–∫—É.</li>\r\n	<li>–ó–∞—Å–≤—ñ–¥—á–µ–Ω—ñ –∫–æ–ø—ñ—ó —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ —Å—É–±&rsquo;—î–∫—Ç–∞ (—Å—É–±&rsquo;—î–∫—Ç—ñ–≤) –∑–æ–≤–Ω—ñ—à–Ω—å–æ–µ–∫–æ–Ω–æ–º—ñ—á–Ω–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ –£–∫—Ä–∞—ó–Ω–∏ —Ç–∞ —Å–≤—ñ–¥–æ—Ü—Ç–≤–∞ –ø—Ä–æ –π–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —è–∫ —Å—É–±&rsquo;—î–∫—Ç–∞ –ø—ñ–¥–ø—Ä–∏—î–º–Ω–∏—Ü—å–∫–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ.</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç–∏, —â–æ —Å–≤—ñ–¥—á–∞—Ç—å –ø—Ä–æ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é (—Å—Ç–≤–æ—Ä–µ–Ω–Ω—è) —ñ–Ω–æ–∑–µ–º–Ω–æ—ó —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ (–Ω–µ—Ä–µ–∑–∏–¥–µ–Ω—Ç–∞) –≤ –∫—Ä–∞—ó–Ω—ñ —ó—ó –º—ñ—Å—Ü–µ–∑–Ω–∞—Ö–æ–¥–∂–µ–Ω–Ω—è (–≤–∏—Ç—è–≥ —ñ–∑ —Ç–æ—Ä–≥—ñ–≤–µ–ª—å–Ω–æ–≥–æ, –±–∞–Ω–∫—ñ–≤—Å—å–∫–æ–≥–æ –∞–±–æ —Å—É–¥–æ–≤–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —Ç–æ—â–æ). –¶—ñ –¥–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–≤–∏–Ω–Ω—ñ –±—É—Ç–∏ –∑–∞—Å–≤—ñ–¥—á–µ–Ω—ñ –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤–∞ –∫—Ä–∞—ó–Ω–∏ —ó—Ö –≤–∏–¥–∞—á—ñ, –ø–µ—Ä–µ–∫–ª–∞–¥–µ–Ω–Ω—ñ —É–∫—Ä–∞—ó–Ω—Å—å–∫–æ—é –º–æ–≤–æ—é —Ç–∞ –ª–µ–≥–∞–ª—ñ–∑–æ–≤–∞–Ω—ñ —É –∫–æ–Ω—Å—É–ª—å—Å—å–∫—ñ–π —É—Å—Ç–∞–Ω–æ–≤—ñ –£–∫—Ä–∞—ó–Ω–∏, —è–∫—â–æ –º—ñ–∂–Ω–∞—Ä–æ–¥–Ω–∏–º–∏ –¥–æ–≥–æ–≤–æ—Ä–∞–º–∏, –≤ —è–∫–∏—Ö –±–µ—Ä–µ —É—á–∞—Å—Ç—å –£–∫—Ä–∞—ó–Ω–∞, –Ω–µ –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–æ —ñ–Ω—à–µ. –ó–∞–∑–Ω–∞—á–µ–Ω—ñ –¥–æ–∫—É–º–µ–Ω—Ç–∏ –º–æ–∂—É—Ç—å –±—É—Ç–∏ –∑–∞—Å–≤—ñ–¥—á–µ–Ω—ñ —Ç–∞–∫–æ–∂ —É –ø–æ—Å–æ–ª—å—Å—Ç–≤—ñ –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ—ó –¥–µ—Ä–∂–∞–≤–∏ –≤ –£–∫—Ä–∞—ó–Ω—ñ —Ç–∞ –ª–µ–≥–∞–ª—ñ–∑–æ–≤–∞–Ω—ñ –≤ –ú–ó–°.</li>\r\n	<li>–õ—ñ—Ü–µ–Ω–∑—ñ—è, —è–∫—â–æ –∑–≥—ñ–¥–Ω–æ —ñ–∑ –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤–æ–º –£–∫—Ä–∞—ó–Ω–∏ —Ü—å–æ–≥–æ –≤–∏–º–∞–≥–∞—î –¥—ñ—è–ª—å–