sp; –¥–æ&nbsp; –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—ó&nbsp; —Ç–∞ –≤–∏–¥–∞–Ω–∏—Ö —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—ñ–≤,&nbsp; –ø–æ–≤–µ—Ä–Ω–µ–Ω–∏—Ö&nbsp; –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ–π&nbsp; —Ç–∞&nbsp; –≤—ñ–¥–º–æ–≤&nbsp; —É&nbsp; –≤–∏–¥–∞—á—ñ —Ç–∞–∫–∏—Ö –¥–æ–∑–≤–æ–ª—ñ–≤&nbsp; —ñ&nbsp; —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—ñ–≤.</li>\r\n</ol>\r\n','<p>–ó–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–∞ –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ—è –Ω–∞–ø—Ä–∞–≤–ª—è—î—Ç—å—Å—è –∑–∞–º–æ–≤–Ω–∏–∫—É –∑–∞—Å–æ–±–∞–º–∏ –ø–æ—à—Ç–æ–≤–æ–≥–æ –∑–≤`—è–∑–∫—É;</p>\r\n\r\n<p>–Ü–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—è —â–æ–¥–æ –∑–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–æ—ó –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ—ó –ø—Ä–æ –≥–æ—Ç–æ–≤–Ω—ñ—Å—Ç—å –æ–±`—î–∫—Ç–∞ –¥–æ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—ó —Ä–æ–∑–º—ñ—â—É—î—Ç—å—Å—è –Ω–∞ –æ—Ñ—ñ—Ü—ñ–π–Ω–æ–º—É —Å–∞–π—Ç—ñ –î–µ—Ä–∂–∞—Ä—Ö–±—É–¥—ñ–Ω—Å–ø–µ–∫—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ —É —Ä–æ–∑–¥—ñ–ª—ñ &laquo;–î–æ–∑–≤—ñ–ª—å–Ω—ñ –¥–æ–∫—É–º–µ–Ω—Ç–∏&raquo; –≤ —î–¥–∏–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ&nbsp; –æ—Ç—Ä–∏–º–∞–Ω–∏—Ö –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω—å&nbsp; –ø—Ä–æ –ø–æ—á–∞—Ç–æ–∫&nbsp; –≤–∏–∫–æ–Ω–∞–Ω–Ω—è&nbsp; –ø—ñ–¥–≥–æ—Ç–æ–≤—á–∏—Ö&nbsp; –±—É–¥—ñ–≤–µ–ª—å–Ω–∏—Ö —Ä–æ–±—ñ—Ç, –∑–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–∏—Ö –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ–π&nbsp; –ø—Ä–æ –ø–æ—á–∞—Ç–æ–∫ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –ø—ñ–¥–≥–æ—Ç–æ–≤—á–∏—Ö —ñ –±—É–¥—ñ–≤–µ–ª—å–Ω–∏—Ö —Ä–æ–±—ñ—Ç, –≤–∏–¥–∞–Ω–∏—Ö&nbsp; –¥–æ–∑–≤–æ–ª—ñ–≤&nbsp; –Ω–∞&nbsp; –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –±—É–¥—ñ–≤–µ–ª—å–Ω–∏—Ö —Ä–æ–±—ñ—Ç, –∑–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–∏—Ö –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ–π&nbsp; –ø—Ä–æ&nbsp; –≥–æ—Ç–æ–≤–Ω—ñ—Å—Ç—å&nbsp; –æ–±&rsquo;—î–∫—Ç–∞&nbsp; –¥–æ&nbsp; –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—ó&nbsp; —Ç–∞ –≤–∏–¥–∞–Ω–∏—Ö —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—ñ–≤,&nbsp; –ø–æ–≤–µ—Ä–Ω–µ–Ω–∏—Ö&nbsp; –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ–π&nbsp; —Ç–∞&nbsp; –≤—ñ–¥–º–æ–≤&nbsp; —É&nbsp; –≤–∏–¥–∞—á—ñ —Ç–∞–∫–∏—Ö –¥–æ–∑–≤–æ–ª—ñ–≤&nbsp; —ñ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—ñ–≤.</p>\r\n','—Ç–∞–∫',0,'',0,'','','',''),(87,'–í–∏–¥–∞—á–∞ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—É —É —Ä–∞–∑—ñ –ø—Ä–∏–π–Ω—è—Ç—Ç—è –≤ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—é –∑–∞–∫—ñ–Ω—á–µ–Ω–æ–≥–æ –±—É–¥—ñ–≤–Ω–∏—Ü—Ç–≤–æ–º –æ–±`—î–∫—Ç–∞',1,16,'<ol>\r\n	<li>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ —Ä–µ–≥—É–ª—é–≤–∞–Ω–Ω—è –º—ñ—Å—Ç–æ–±—É–¥—ñ–≤–Ω–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ&raquo; —á–∞—Å—Ç–∏–Ω–∞ –¥—Ä—É–≥–∞ —Å—Ç–∞—Ç—Ç—ñ 39.</li>\r\n	<li>–ü—É–Ω–∫—Ç 22 –ü–æ—Ä—è–¥–∫—É &nbsp;–ø—Ä–∏–π–Ω—è—Ç—Ç—è –≤ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—é –∑–∞–∫—ñ–Ω—á–µ–Ω–∏—Ö –±—É–¥—ñ–≤–Ω–∏—Ü—Ç–≤–æ–º –æ–±&rsquo;—î–∫—Ç—ñ–≤, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–æ–≥–æ –ø–æ—Å—Ç–∞–Ω–æ–≤–æ—é –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 13.04.2011 ‚Ññ 461 &laquo;–ü–∏—Ç–∞–Ω–Ω—è –ø—Ä–∏–π–Ω—è—Ç—Ç—è –≤ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—é –∑–∞–∫—ñ–Ω—á–µ–Ω–∏—Ö –±—É–¥—ñ–≤–Ω–∏—Ü—Ç–≤–æ–º –æ–±&rsquo;—î–∫—Ç—ñ–≤&raquo;.</li>\r\n</ol>\r\n','<p>–ï–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—è –∑–∞–∫—ñ–Ω—á–µ–Ω–æ–≥–æ –±—É–¥—ñ–≤–Ω–∏—Ü—Ç–≤–æ–º –æ–±&rsquo;—î–∫—Ç–∞ IV &ndash; V –∫–∞—Ç–µ–≥–æ—Ä—ñ—ó —Å–∫–ª–∞–¥–Ω–æ—Å—Ç—ñ.</p>\r\n','<p>–ü–æ–¥–∞—î—Ç—å—Å—è –æ—Å–æ–±–∏—Å—Ç–æ –∑–∞–º–æ–≤–Ω–∏–∫–æ–º (–π–æ–≥–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–æ—é –æ—Å–æ–±–æ—é) –¥–æ –¶–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥&nbsp;–∞–±–æ –Ω–∞–¥—Å–∏–ª–∞—î—Ç—å—Å—è —Ä–µ–∫–æ–º–µ–Ω–¥–æ–≤–∞–Ω–∏–º –ª–∏—Å—Ç–æ–º –∑ –æ–ø–∏—Å–æ–º –≤–∫–ª–∞–¥–µ–Ω–Ω—è.</p>\r\n','<ol>\r\n	<li>–ó–∞—è–≤–∞ –∑–∞ —Ñ–æ—Ä–º–æ—é –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–≥–æ –∑—Ä–∞–∑–∫–∞.</li>\r\n	<li>–ê–∫—Ç –≥–æ—Ç–æ–≤–Ω–æ—Å—Ç—ñ –æ–±&rsquo;—î–∫—Ç–∞ –¥–æ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—ó –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ –≤–∏–º–æ–≥ —á–∞—Å—Ç–∏–Ω–∏ –¥—Ä—É–≥–æ—ó —Å—Ç–∞—Ç—Ç—ñ 39 –ó–∞–∫–æ–Ω—É –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ —Ä–µ–≥—É–ª—é–≤–∞–Ω–Ω—è –º—ñ—Å—Ç–æ–±—É–¥—ñ–≤–Ω–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ&raquo; –∑–∞ —Ñ–æ—Ä–º–æ—é –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–≥–æ –∑—Ä–∞–∑–∫–∞.</li>\r\n</ol>\r\n',1,'<p>–í—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ –ü–æ—Ä—è–¥–∫—É –≤–Ω–µ—Å–µ–Ω–Ω—è –ø–ª–∞—Ç–∏ –∑–∞ –≤–∏–¥–∞—á—É —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞, —è–∫–∏–π –≤–∏–¥–∞—î—Ç—å—Å—è —É —Ä–∞–∑—ñ –ø—Ä–∏–π–Ω—è—Ç—Ç—è –≤ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—é –∑–∞–∫—ñ–Ω—á–µ–Ω–æ–≥–æ –±—É–¥—ñ–≤–Ω–∏—Ü—Ç–≤–æ–º –æ–±&rsquo;—î–∫—Ç–∞, —Ç–∞ —ó—ó —Ä–æ–∑–º—ñ—Ä, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–æ–≥–æ –ø–æ—Å—Ç–∞–Ω–æ–≤–æ—é –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –≤—ñ–¥ 13.04.2011 ‚Ññ 461 &laquo;–ü–∏—Ç–∞–Ω–Ω—è –ø—Ä–∏–π–Ω—è—Ç—Ç—è –≤ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—é –∑–∞–∫—ñ–Ω—á–µ–Ω–∏—Ö –±—É–¥—ñ–≤–Ω–∏—Ü—Ç–≤–æ–º –æ–±&rsquo;—î–∫—Ç—ñ–≤&raquo;.</p>\r\n','<p>–î–ª—è –∑–∞–∫—ñ–Ω—á–µ–Ω–∏—Ö –±—É–¥—ñ–≤–Ω–∏—Ü—Ç–≤–æ–º –æ–±`—î–∫—Ç—ñ–≤, —â–æ –Ω–∞–ª–µ–∂–∞—Ç—å:</p>\r\n\r\n<p>–¥–æ –æ–±&rsquo;—î–∫—Ç—ñ–≤ IV –∫–∞—Ç–µ–≥–æ—Ä—ñ—ó —Å–∫–ª–∞–¥–Ω–æ—Å—Ç—ñ &ndash; 4,6 –º—ñ–Ω—ñ–º–∞–ª—å–Ω–æ—ó –∑–∞—Ä–æ–±—ñ—Ç–Ω–æ—ó –ø–ª–∞—Ç–∏;</p>\r\n\r\n<p>–¥–æ –æ–±&rsquo;—î–∫—Ç—ñ–≤ V –∫–∞—Ç–µ–≥–æ—Ä—ñ—ó —Å–∫–ª–∞–¥–Ω–æ—Å—Ç—ñ &ndash; 5,2 –º—ñ–Ω—ñ–º–∞–ª—å–Ω–æ—ó –∑–∞—Ä–æ–±—ñ—Ç–Ω–æ—ó –ø–ª–∞—Ç–∏.</p>\r\n','<p>–û—Ç—Ä–∏–º—É–≤–∞—á: –£–î–ö–°–£ —É –î–Ω—ñ–ø—Ä–æ–≤—Å—å–∫–æ–º—É —Ä-–Ω—ñ –º. –ö–∏—î–≤–∞</p>\r\n\r\n<p>–ö–æ–¥ 38012871</p>\r\n\r\n<p>–ì–£–î–ö–°–£ –£–∫—Ä–∞—ó–Ω–∏ —É –º. –ö–∏—î–≤—ñ</p>\r\n\r\n<p>–ú–§–û 820019; —Ä/—Ä 31115028700005</p>\r\n\r\n<p>–ó–∞ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç –∑–≥—ñ–¥–Ω–æ –∑ –ø–æ—Å—Ç–∞–Ω–æ–≤–æ—é –ö–ú–£ –≤—ñ–¥ 13.04.2011 ‚Ññ 461</p>\r\n','<p>–î–µ—Å—è—Ç—å —Ä–æ–±–æ—á–∏—Ö –¥–Ω—ñ–≤ –∑ –¥–Ω—è —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –∑–∞—è–≤–∏.</p>\r\n','<ol>\r\n	<li>–ù–µ–ø–æ–¥–∞–Ω–Ω—è –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤, –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö –¥–ª—è –ø—Ä–∏–π–Ω—è—Ç—Ç—è —Ä—ñ—à–µ–Ω–Ω—è –ø—Ä–æ –≤–∏–¥–∞—á—É —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞.</li>\r\n	<li>–í–∏—è–≤–ª–µ–Ω–Ω—è –Ω–µ–¥–æ—Å—Ç–æ–≤—ñ—Ä–Ω–∏—Ö –≤—ñ–¥–æ–º–æ—Å—Ç–µ–π —É –ø–æ–¥–∞–Ω–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç–∞—Ö.</li>\r\n	<li>–ù–µ–≤—ñ–¥–ø–æ–≤—ñ–¥–Ω—ñ—Å—Ç—å –æ–±&rsquo;—î–∫—Ç–∞ –ø—Ä–æ–µ–∫—Ç–Ω—ñ–π –¥–æ–∫—É–º–µ–Ω—Ç–∞—Ü—ñ—ó —Ç–∞ –≤–∏–º–æ–≥–∞–º –¥–µ—Ä–∂–∞–≤–Ω–∏—Ö –±—É–¥—ñ–≤–µ–ª—å–Ω–∏—Ö –Ω–æ—Ä–º, —Å—Ç–∞–Ω–¥–∞—Ä—Ç—ñ–≤ —ñ –ø—Ä–∞–≤–∏–ª.</li>\r\n</ol>\r\n','<p>–í–∏–¥–∞—á–∞ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞.</p>\r\n','<p>–°–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç –Ω–∞–ø—Ä–∞–≤–ª—è—î—Ç—å—Å—è –∑–∞–º–æ–≤–Ω–∏–∫—É –∑–∞—Å–æ–±–∞–º–∏ –ø–æ—à—Ç–æ–≤–æ–≥–æ –∑–≤`—è–∑–∫—É. –Ü–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—è —â–æ–¥–æ –≤–∏–¥–∞–Ω–æ–≥–æ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç–∞&nbsp; —Ä–æ–∑–º—ñ—â—É—î—Ç—å—Å—è –Ω–∞ –æ—Ñ—ñ—Ü—ñ–π–Ω–æ–º—É —Å–∞–π—Ç—ñ –î–µ—Ä–∂–∞—Ä—Ö–±—É–¥—ñ–Ω—Å–ø–µ–∫—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ —É —Ä–æ–∑–¥—ñ–ª—ñ &laquo;–î–æ–∑–≤—ñ–ª—å–Ω—ñ –¥–æ–∫—É–º–µ–Ω—Ç–∏&raquo; —É —î–¥–∏–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ –æ—Ç—Ä–∏–º–∞–Ω–∏—Ö –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω—å –ø—Ä–æ –ø–æ—á–∞—Ç–æ–∫ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –ø—ñ–¥–≥–æ—Ç–æ–≤—á–∏—Ö —ñ –±—É–¥—ñ–≤–µ–ª—å–Ω–∏—Ö —Ä–æ–±—ñ—Ç, –∑–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–∏—Ö –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ–π –ø—Ä–æ –ø–æ—á–∞—Ç–æ–∫ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –ø—ñ–¥–≥–æ—Ç–æ–≤—á–∏—Ö —ñ –±—É–¥—ñ–≤–µ–ª—å–Ω–∏—Ö —Ä–æ–±—ñ—Ç, –≤–∏–¥–∞–Ω–∏—Ö –¥–æ–∑–≤–æ–ª—ñ–≤ –Ω–∞ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –±—É–¥—ñ–≤–µ–ª—å–Ω–∏—Ö —Ä–æ–±—ñ—Ç, –∑–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–∏—Ö –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ–π –ø—Ä–æ –≥–æ—Ç–æ–≤–Ω—ñ—Å—Ç—å –æ–±&rsquo;—î–∫—Ç–∞&nbsp; –¥–æ –µ–∫—Å–ø–ª—É–∞—Ç–∞—Ü—ñ—ó —Ç–∞ –≤–∏–¥–∞–Ω–∏—Ö —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—ñ–≤, –≤—ñ–¥–º–æ–≤ —É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó —Ç–∞–∫–∏—Ö –¥–µ–∫–ª–∞—Ä–∞—Ü—ñ–π —Ç–∞ —É –≤–∏–¥–∞—á—ñ —Ç–∞–∫–∏—Ö –¥–æ–∑–≤–æ–ª—ñ–≤ —ñ —Å–µ—Ä—Ç–∏—Ñ—ñ–∫–∞—Ç—ñ–≤.</p>\r\n','–Ω—ñ',0,'',0,'','','',''),(88,'–î–µ—Ä–∂–∞–≤–Ω–∞ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—è —Ñ—ñ–∑–∏—á–Ω–æ—ó –æ—Å–æ–±–∏, —è–∫–∞ –º–∞—î –Ω–∞–º—ñ—Ä —Å—Ç–∞—Ç–∏ –ø—ñ–¥–ø—Ä–∏—î–º—Ü–µ–º\r\n',1,17,'<ol>\r\n	<li>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 15.05.2003 ‚Ññ 755-IV &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot; (–∑—ñ&nbsp; –∑–º—ñ–Ω–∞–º–∏&nbsp; —Ç–∞&nbsp; –¥–æ–ø–æ–≤–Ω–µ–Ω–Ω—è–º–∏)&nbsp;&nbsp;(—Å—Ç–∞—Ç—Ç—ñ 8, 10, 42, 43, 44).</li>\r\n	<li>–ü–æ—Ä—è–¥–æ–∫ –ø–æ–¥–∞–Ω–Ω—è —Ç–∞ –æ–±—ñ–≥—É –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä–∞—Ç–æ—Ä—É, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–∏–π –Ω–∞–∫–∞–∑–æ–º –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ —é—Å—Ç–∏—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 19.08.2011 ‚Ññ 2010/5, –∑–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–∏–π –≤ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤—ñ —é—Å—Ç–∏—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ 23.08.2011 –∑–∞ ‚Ññ 997/19735.</li>\r\n	<li>–ù–∞–∫–∞–∑ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ —é—Å—Ç–∏—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 14.10.2011&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ‚Ññ 3178/5 &quot;–ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è —Ñ–æ—Ä–º —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π–Ω–∏—Ö –∫–∞—Ä—Ç–æ–∫&quot;, –∑–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–∏–π –≤ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤—ñ —é—Å—Ç–∏—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ 19.10.2011 –∑–∞ ‚Ññ 1207/19945.</li>\r\n	<li>–ù–∞–∫–∞–∑ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ —é—Å—Ç–∏—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 17.04.2013&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ‚Ññ 730/5 &quot;–ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è —Ñ–æ—Ä