<li>–ö–æ–ø—ñ—è –¥–æ–∫—É–º–µ–Ω—Ç–∞, —â–æ –∑–∞—Å–≤—ñ–¥—á—É—î —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —É –î–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø–ª–∞—Ç–Ω–∏–∫—ñ–≤ –ø–æ–¥–∞—Ç–∫—ñ–≤.</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –≤–Ω–µ—Å–µ–Ω–Ω—è —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π–Ω–æ–≥–æ –∑–±–æ—Ä—É&nbsp; –∑–∞ –ø—Ä–æ–≤–µ–¥–µ–Ω–Ω—è –¥–µ—Ä–∂–∞–≤–Ω–æ—ó —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó —Ñ—ñ–∑–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—è (–∫–æ–ø—ñ—è –∫–≤–∏—Ç–∞–Ω—Ü—ñ—ó, –≤–∏–¥–∞–Ω–æ—ó –±–∞–Ω–∫–æ–º, –∞–±–æ –∫–æ–ø—ñ—è –ø–ª–∞—Ç—ñ–∂–Ω–æ–≥–æ –¥–æ—Ä—É—á–µ–Ω–Ω—è –∑ –≤—ñ–¥–º—ñ—Ç–∫–æ—é –±–∞–Ω–∫—É).</li>\r\n	<li>–ù–æ—Ç–∞—Ä—ñ–∞–ª—å–Ω–æ –ø–æ—Å–≤—ñ–¥—á–µ–Ω–∞ –ø–∏—Å—å–º–æ–≤–∞ –∑–≥–æ–¥–∞ –±–∞—Ç—å–∫—ñ–≤ (—É—Å–∏–Ω–æ–≤–ª—é–≤–∞—á—ñ–≤) –∞–±–æ –ø—ñ–∫–ª—É–≤–∞–ª—å–Ω–∏–∫–∞, –∞–±–æ –æ—Ä–≥–∞–Ω—É –æ–ø—ñ–∫–∏ —Ç–∞ –ø—ñ–∫–ª—É–≤–∞–Ω–Ω—è, —è–∫—â–æ –∑–∞—è–≤–Ω–∏–∫–æ–º —î —Ñ—ñ–∑–∏—á–Ω–∞ –æ—Å–æ–±–∞, —è–∫–∞ –¥–æ—Å—è–≥–ª–∞ —à—ñ—Å—Ç–Ω–∞–¥—Ü—è—Ç–∏ —Ä–æ–∫—ñ–≤ —ñ –º–∞—î –±–∞–∂–∞–Ω–Ω—è –∑–∞–π–º–∞—Ç–∏—Å—è –ø—ñ–¥–ø—Ä–∏—î–º–Ω–∏—Ü—å–∫–æ—é –¥—ñ—è–ª—å–Ω—ñ—Å—Ç—é.</li>\r\n	<li>–Ø–∫—â–æ –¥–æ–∫—É–º–µ–Ω—Ç–∏ –¥–ª—è –ø—Ä–æ–≤–µ–¥–µ–Ω–Ω—è –¥–µ—Ä–∂–∞–≤–Ω–æ—ó —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –ø–æ–¥–∞—é—Ç—å—Å—è –∑–∞—è–≤–Ω–∏–∫–æ–º –æ—Å–æ–±–∏—Å—Ç–æ, –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä–∞—Ç–æ—Ä—É –¥–æ–¥–∞—Ç–∫–æ–≤–æ –ø—Ä–µ–¥&#39;—è–≤–ª—è—î—Ç—å—Å—è –ø–∞—Å–ø–æ—Ä—Ç –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –∞–±–æ –ø–∞—Å–ø–æ—Ä—Ç–Ω–∏–π –¥–æ–∫—É–º–µ–Ω—Ç —ñ–Ω–æ–∑–µ–º—Ü—è.&nbsp;</li>\r\n</ol>\r\n',1,'<p>???</p>\r\n','<p>–ó–∞ –ø—Ä–æ–≤–µ–¥–µ–Ω–Ω—è –¥–µ—Ä–∂–∞–≤–Ω–æ—ó —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó —Ñ—ñ–∑–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—è —Å–ø—Ä–∞–≤–ª—è—î—Ç—å—Å—è —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π–Ω–∏–π –∑–±—ñ—Ä —É —Ä–æ–∑–º—ñ—Ä—ñ –¥–≤–æ—Ö –Ω–µ–æ–ø–æ–¥–∞—Ç–∫–æ–≤—É–≤–∞–Ω–∏—Ö –º—ñ–Ω—ñ–º—É–º—ñ–≤ –¥–æ—Ö–æ–¥—ñ–≤ –≥—Ä–æ–º–∞–¥—è–Ω&nbsp;(34 –≥—Ä–Ω.)</p>\r\n','<p>???</p>\r\n','<p>–°—Ç—Ä–æ–∫ –¥–µ—Ä–∂–∞–≤–Ω–æ—ó —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó —Ñ—ñ–∑–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—è –Ω–µ –ø–æ–≤–∏–Ω–µ–Ω –ø–µ—Ä–µ–≤–∏—â—É–≤–∞—Ç–∏ –¥–≤–∞ —Ä–æ–±–æ—á–∏—Ö –¥–Ω—ñ –∑ –¥–∞—Ç–∏ –Ω–∞–¥—Ö–æ–¥–∂–