–∞—Ç–∏ –Ω–∞–¥—Ö–æ–¥–∂–µ–Ω–Ω—è –∑–∞–ø–∏—Ç—É –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –≤–∏—Ç—è–≥—É –∑ –Ñ–¥–∏–Ω–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤.</p>\r\n','<ol>\r\n	<li>–£ –∑–∞–ø–∏—Ç—ñ –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –≤–∏—Ç—è–≥—É –≤—ñ–¥—Å—É—Ç–Ω—ñ –∫—Ä–∏—Ç–µ—Ä—ñ—ó –ø–æ—à—É–∫—É –≤—ñ–¥–æ–º–æ—Å—Ç–µ–π —É –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤, —è–∫—ñ –±—É–ª–∏ –∑–∞–∑–Ω–∞—á–µ–Ω—ñ —É –∑–∞–ø–∏—Ç—ñ –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –≤–∏—Ç—è–≥—É –Ω–∞ –≤–∏–±—ñ—Ä –∑–∞–ø–∏—Ç—É–≤–∞—á–∞ –¥–ª—è –π–æ–≥–æ —Ñ–æ—Ä–º—É–≤–∞–Ω–Ω—è.</li>\r\n	<li>–ó–∞–ø–∏—Ç—É–≤–∞—á–µ–º –Ω–µ –ø–æ–¥–∞–Ω–æ –¥–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –≤–Ω–µ—Å–µ–Ω–Ω—è –ø–ª–∞—Ç–∏ –∑–∞ –æ—Ç—Ä–∏–º–∞–Ω–Ω—è –≤–∏—Ç—è–≥—É, –∫—Ä—ñ–º –≤–∏–ø–∞–¥–∫—ñ–≤, –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏—Ö –ó–∞–∫–æ–Ω–æ–º –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 15.05.2003 ‚Ññ 755-IV &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot;, –∞–±–æ –ø–ª–∞—Ç–∞ –≤–Ω–µ—Å–µ–Ω–∞ –Ω–µ –≤ –ø–æ–≤–Ω–æ–º—É –æ–±—Å—è–∑—ñ.</li>\r\n</ol>\r\n','<ol>\r\n	<li>–í–∏—Ç—è–≥ –∑ –Ñ–¥–∏–Ω–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤.</li>\r\n	<li>–ü–∏—Å—å–º–æ–≤–µ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è –ø—Ä–æ –≤—ñ–¥–º–æ–≤—É —É –Ω–∞–¥–∞–Ω–Ω—ñ –≤—ñ–¥–æ–º–æ—Å—Ç–µ–π –∑ –Ñ–¥–∏–Ω–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤.</li>\r\n</ol>\r\n','<p>–î–µ—Ä–∂–∞–≤–Ω–∏–π —Ä–µ—î—Å—Ç—Ä–∞—Ç–æ—Ä –≤–∏–¥–∞—î –≤–∏—Ç—è–≥ –∑ –Ñ–¥–∏–Ω–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ –æ—Å–æ–±—ñ, —è–∫–∞ –ø–æ–¥–∞–ª–∞ –∑–∞–ø–∏—Ç, –∞–±–æ, —É —Ä–∞–∑—ñ –ø—Ä–æ—Å—Ç–∞–≤–ª–µ–Ω–Ω—è –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ—ó –≤—ñ–¥–º—ñ—Ç–∫–∏ —É –∑–∞–ø–∏—Ç—ñ, –Ω–∞–¥—Å–∏–ª–∞—î —ó—ó –ø–æ—à—Ç–æ–≤–∏–º –≤—ñ–¥–ø—Ä–∞–≤–ª–µ–Ω–Ω—è–º.</p>\r\n','–Ω—ñ',0,'',0,'','','',''),(92,'–í–∏–¥–∞—á–∞ –¥–æ–≤—ñ–¥–∫–∏ –∑ –Ñ–¥–∏–Ω–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–±  –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤.\r\n',1,17,'<p>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 15.05.2003 ‚Ññ 755-IV &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot; (—Å—Ç–∞—Ç—Ç—ñ 8, 20).</p>\r\n','<p>–ó–∞–ø–∏—Ç –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –¥–æ–≤—ñ–¥–∫–∏ –ø—Ä–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å –∞–±–æ –≤—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –≤ –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó, —è–∫–∞ –∑–∞–ø–∏—Ç—É—î—Ç—å—Å—è.</p>\r\n','<p>–û—Å–æ–±–∏—Å—Ç–æ –∞–±–æ –ø–æ—à—Ç–æ–≤–∏–º –≤—ñ–¥–ø—Ä–∞–≤–ª–µ–Ω–Ω—è–º –∑ –æ–ø–∏—Å–æ–º –≤–∫–ª–∞–¥–µ–Ω–Ω—è.&nbsp;</p>\r\n','<ol>\r\n	<li>–ó–∞–ø–∏—Ç –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –¥–æ–≤—ñ–¥–∫–∏ –ø—Ä–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å –∞–±–æ –≤—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –≤ –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó, —è–∫–∞ –∑–∞–ø–∏—Ç—É—î—Ç—å—Å—è.</li>\r\n	<li>–ó–∞–ø–∏—Ç –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –¥–æ–≤—ñ–¥–∫–∏ –ø—Ä–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å –∞–±–æ –≤—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –≤ –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó, —è–∫–∞ –∑–∞–ø–∏—Ç—É—î—Ç—å—Å—è –∑–∞–ø–æ–≤–Ω—é—é—Ç—å—Å—è —É–∫—Ä–∞—ó–Ω—Å—å–∫–æ—é –º–æ–≤–æ—é –º–∞—à–∏–Ω–æ–¥—Ä—É–∫–æ–º –∞–±–æ –≤—ñ–¥ —Ä—É–∫–∏ —Ä–æ–∑–±—ñ—Ä–ª–∏–≤–∏–º–∏ –¥—Ä—É–∫–æ–≤–∞–Ω–∏–º–∏ –ª—ñ—Ç–µ—Ä–∞–º–∏, –±–µ–∑ –≤–∏–ø—Ä–∞–≤–ª–µ–Ω—å.</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –≤–Ω–µ—Å–µ–Ω–Ω—è –ø–ª–∞—Ç–∏ –∑–∞ –æ—Ç—Ä–∏–º–∞–Ω–Ω—è –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–∏—Ö –≤—ñ–¥–æ–º–æ—Å—Ç–µ–π (–∫–æ–ø—ñ—è –∫–≤–∏—Ç–∞–Ω—Ü—ñ—ó, –≤–∏–¥–∞–Ω–æ—ó –±–∞–Ω–∫–æ–º, –∞–±–æ –∫–æ–ø—ñ—è –ø–ª–∞—Ç—ñ–∂–Ω–æ–≥–æ –¥–æ—Ä—É—á–µ–Ω–Ω—è –∑ –≤—ñ–¥–º—ñ—Ç–∫–æ—é –±–∞–Ω–∫—É).</li>\r\n</ol>\r\n',1,'<p>???</p>\r\n','<p>–û–¥–∏–Ω –Ω–µ–æ–ø–æ–¥–∞—Ç–∫–æ–≤—É–≤–∞–Ω–∏–π –º—ñ–Ω—ñ–º—É–º –¥–æ—Ö–æ–¥—ñ–≤ –≥—Ä–æ–º–∞–¥—è–Ω (17 –≥—Ä–Ω.).</p>\r\n','<p>???</p>\r\n','<p>–°—Ç—Ä–æ–∫ –Ω–∞–¥–∞–Ω–Ω—è –¥–æ–≤—ñ–¥–∫–∏ –ø—Ä–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å –∞–±–æ –≤—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –≤ –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó, —è–∫–∞ –∑–∞–ø–∏—Ç—É—î—Ç—å—Å—è –Ω–µ –ø–æ–≤–∏–Ω–µ–Ω –ø–µ—Ä–µ–≤–∏—â—É–≤–∞—Ç–∏ –ø&#39;—è—Ç–∏ —Ä–æ–±–æ—á–∏—Ö –¥–Ω—ñ–≤ –∑ –¥–∞—Ç–∏ –Ω–∞–¥—Ö–æ–¥–∂–µ–Ω–Ω—è –∑–∞–ø–∏—Ç—É –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –¥–æ–≤—ñ–¥–∫–∏ –ø—Ä–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å –∞–±–æ –≤—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –≤ –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó, —è–∫–∞ –∑–∞–ø–∏—Ç—É—î—Ç—å—Å—è.</p>\r\n','<ol>\r\n	<li>–£ –∑–∞–ø–∏—Ç—ñ –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –¥–æ–≤—ñ–¥–∫–∏ –≤—ñ–¥—Å—É—Ç–Ω—ñ –∫—Ä–∏—Ç–µ—Ä—ñ—ó –ø–æ—à—É–∫—É –≤—ñ–¥–æ–º–æ—Å—Ç–µ–π —É –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤, —è–∫—ñ –±—É–ª–∏ –∑–∞–∑–Ω–∞—á–µ–Ω—ñ —É –∑–∞–ø–∏—Ç—ñ –ø—Ä–æ –Ω–∞–¥–∞–Ω–Ω—è –¥–æ–≤—ñ–¥–∫–∏ –ø—Ä–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å –∞–±–æ –≤—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –≤ –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó, —è–∫–∞ –∑–∞–ø–∏—Ç—É—î—Ç—å—Å—è.</li>\r\n	<li>–ó–∞–ø–∏—Ç—É–≤–∞—á–µ–º –Ω–µ –ø–æ–¥–∞–Ω–æ –¥–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –≤–Ω–µ—Å–µ–Ω–Ω—è –ø–ª–∞—Ç–∏ –∑–∞ –æ—Ç—Ä–∏–º–∞–Ω–Ω—è –¥–æ–≤—ñ–¥–∫–∏, –∫—Ä—ñ–º –≤–∏–ø–∞–¥–∫—ñ–≤, –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏—Ö –ó–∞–∫–æ–Ω–æ–º –£–∫—Ä–∞—ó–Ω–∏ &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot;, –∞–±–æ –ø–ª–∞—Ç–∞ –≤–Ω–µ—Å–µ–Ω–∞ –Ω–µ –≤ –ø–æ–≤–Ω–æ–º—É –æ–±—Å—è–∑—ñ.</li>\r\n</ol>\r\n','<ol>\r\n	<li>–î–æ–≤—ñ–¥–∫–∞ –ø—Ä–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å –∞–±–æ –≤—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –≤ –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó, —è–∫–∞ –∑–∞–ø–∏—Ç—É—î—Ç—å—Å—è.</li>\r\n	<li>–ü–∏—Å—å–º–æ–≤–µ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è –ø—Ä–æ –≤—ñ–¥–º–æ–≤—É —É –Ω–∞–¥–∞–Ω–Ω—ñ –≤—ñ–¥–æ–º–æ—Å—Ç–µ–π –∑ –Ñ–¥–∏–Ω–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤.</li>\r\n</ol>\r\n','<p>–î–µ—Ä–∂–∞–≤–Ω–∏–π —Ä–µ—î—Å—Ç—Ä–∞—Ç–æ—Ä –≤–∏–¥–∞—î –¥–æ–≤—ñ–¥–∫—É –ø—Ä–æ –Ω–∞—è–≤–Ω—ñ—Å—Ç—å –∞–±–æ –≤—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –≤ –Ñ–¥–∏–Ω–æ–º—É –¥–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó, —è–∫–∞ –∑–∞–ø–∏—Ç—É—î—Ç—å—Å—è –æ—Å–æ–±—ñ, —è–∫–∞ –ø–æ–¥–∞–ª–∞ –∑–∞–ø–∏—Ç, –∞–±–æ, —É —Ä–∞–∑—ñ –ø—Ä–æ—Å—Ç–∞–≤–ª–µ–Ω–Ω—è –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ—ó –≤—ñ–¥–º—ñ—Ç–∫–∏ —É –∑–∞–ø–∏—Ç—ñ, –Ω–∞–¥—Å–∏–ª–∞—î —ó—ó –ø–æ—à—Ç–æ–≤–∏–º –≤—ñ–¥–ø—Ä–∞–≤–ª–µ–Ω–Ω—è–º.</p>\r\n','–Ω—ñ',0,'',0,'','','',''),(93,'–î–µ—Ä–∂–∞–≤–Ω–∞ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—è –∑–º—ñ–Ω –¥–æ —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏\r\n',1,17,'<p>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 15.05.2003 ‚Ññ 755-IV &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot; (–∑—ñ&nbsp; –∑–º—ñ–Ω–∞–º–∏ &nbsp;—Ç–∞&nbsp; –¥–æ–ø–æ–≤–Ω–µ–Ω–Ω—è–º–∏)&nbsp;(—Å—Ç–∞—Ç—Ç—ñ 8, 10, 29, 30).</p>\r\n','<p>–ó–≤–µ—Ä–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ —É –∑–≤&rsquo;—è–∑–∫—É —ñ–∑ –ø—Ä–∏–π–Ω—è—Ç—Ç—è–º —Ä—ñ—à–µ–Ω–Ω—è –ø—Ä–æ –≤–Ω–µ—Å–µ–Ω–Ω—è –∑–º—ñ–Ω –¥–æ —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö&nbsp; –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏.</p>\r\n','<p>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞—é—Ç—å—Å—è (–Ω–∞–¥—Å–∏–ª–∞—é—Ç—å—Å—è –