Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ —Ç–∞ –∑–º—ñ–Ω –¥–æ –Ω–∏—Ö\r\n',1,17,'<p>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 15.05.2003 ‚Ññ 755-IV &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot; (–∑—ñ&nbsp; –∑–º—ñ–Ω–∞–º–∏&nbsp; —Ç–∞&nbsp; –¥–æ–ø–æ–≤–Ω–µ–Ω–Ω—è–º–∏)&nbsp;(—Å—Ç–∞—Ç—Ç—ñ —á.1 —Å—Ç.6, —á.3 —Å—Ç.10).</p>\r\n','<p>–ó–≤–µ—Ä–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏.</p>\r\n','<p>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞—é—Ç—å—Å—è –∑–∞—Å–Ω–æ–≤–Ω–∏–∫–∞–º–∏ (—É—á–∞—Å–Ω–∏–∫–∞–º–∏) —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ –∞–±–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–∏–º –Ω–∏–º–∏ –æ—Ä–≥–∞–Ω–æ–º —á–∏ –æ—Å–æ–±–æ—é.</p>\r\n','<ol>\r\n	<li>–ó–∞—è–≤–∞&nbsp; –ø—Ä–æ&nbsp; –ø—Ä–æ –≤–∏–¥–∞—á—É –¥—É–±–ª—ñ–∫–∞—Ç–∞ —É –¥–æ–≤—ñ–ª—å–Ω—ñ–π —Ñ–æ—Ä–º—ñ.</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –≤–Ω–µ—Å–µ–Ω–Ω—è –ø–ª–∞—Ç–∏ –∑–∞&nbsp; –ø—É–±–ª—ñ–∫–∞—Ü—ñ—é&nbsp; —É —Å–ø–µ—Ü—ñ–∞–ª—å–Ω–æ–º—É&nbsp; –¥—Ä—É–∫–æ–≤–∞–Ω–æ–º—É&nbsp; –∑–∞—Å–æ–±—ñ&nbsp; –º–∞—Å–æ–≤–æ—ó —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è –ø—Ä–æ –≤—Ç—Ä–∞—Ç—É –æ—Ä–∏–≥—ñ–Ω–∞–ª—ñ–≤ —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ (–∫–æ–ø—ñ—è&nbsp; –∫–≤–∏—Ç–∞–Ω—Ü—ñ—ó –∞–±–æ –∫–æ–ø—ñ—è –ø–ª–∞—Ç—ñ–∂–Ω–æ–≥–æ –¥–æ—Ä—É—á–µ–Ω–Ω—è –∑ –≤—ñ–¥–º—ñ—Ç–∫–æ—é –±–∞–Ω–∫—É).</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –≤–Ω–µ—Å–µ–Ω–Ω—è —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π–Ω–æ–≥–æ –∑–±–æ—Ä—É –∑–∞ –≤–∏–¥–∞—á—É –¥—É–±–ª—ñ–∫–∞—Ç–∞ —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ —Ç–∞ –∑–º—ñ–Ω –¥–æ –Ω–∏—Ö</li>\r\n</ol>\r\n',1,'<p>???</p>\r\n','<p>–°–ø—Ä–∞–≤–ª—è—î—Ç—å—Å—è —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π–Ω–∏–π –∑–±—ñ—Ä —É —Ä–æ–∑–º—ñ—Ä—ñ –æ–¥–Ω–æ–≥–æ –Ω–µ–æ–ø–æ–¥–∞—Ç–∫–æ–≤–∞–Ω–æ–≥–æ –º—ñ–Ω—ñ–º—É–º—É –¥–æ—Ö–æ–¥—ñ–≤ –≥—Ä–æ–º–∞–¥—è–Ω (17 –≥—Ä–Ω).</p>\r\n','<p>???</p>\r\n','<p>???</p>\r\n','<ol>\r\n	<li>–ó–∞—è–≤–∞ –æ—Ñ–æ—Ä–º–ª–µ–Ω–∞ –∑ –ø–æ—Ä—É—à–µ–Ω–Ω—è–º –≤–∏–º–æ–≥,&nbsp; –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏—Ö&nbsp; —á–∞—Å—Ç–∏–Ω–∞–º–∏&nbsp; –ø–µ—Ä—à–æ—é —Ç–∞ –¥—Ä—É–≥–æ—é —Å—Ç–∞—Ç—Ç—ñ 8 –ó–∞–∫–æ–Ω—É –£–∫—Ä–∞—ó–Ω–∏ &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot;.</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞–Ω—ñ –Ω–µ –≤ –ø–æ–≤–Ω–æ–º—É –æ–±—Å—è–∑—ñ.</li>\r\n	<li>–î–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä–∞—Ç–æ—Ä–∞ –Ω–∞–¥—ñ–π—à–ª–æ —Ä—ñ—à–µ–Ω–Ω—è —Å—É–¥—É —â–æ–¥–æ –∑–∞–±–æ—Ä–æ–Ω–∏ –ø—Ä–æ–≤–µ–¥–µ–Ω–Ω—è —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π–Ω–∏—Ö –¥—ñ–π.</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞–Ω—ñ –∑–∞ –Ω–µ–Ω–∞–ª–µ–∂–Ω–∏–º –º—ñ—Å—Ü–µ–º —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó.</li>\r\n</ol>\r\n','<ol>\r\n	<li>–ü–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è –ø—Ä–æ –∑–∞–ª–∏—à–µ–Ω–Ω—è –∑–∞—è–≤–∏ –ø—Ä–æ –≤–∏–¥–∞—á—É –¥—É–±–ª—ñ–∫–∞—Ç—É &nbsp;—É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –±–µ–∑ —Ä–æ–∑–≥–ª—è–¥—É.</li>\r\n	<li>–í–∏–¥–∞—á–∞ –¥—É–±–ª—ñ–∫–∞—Ç—É —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ —Ç–∞ –∑–º—ñ–Ω –¥–æ –Ω–∏—Ö.</li>\r\n</ol>\r\n','<p>–î—É–±–ª—ñ–∫–∞—Ç —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ —Ç–∞ –∑–º—ñ–Ω –¥–æ –Ω–∏—Ö –∞–±–æ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è –ø—Ä–æ –∑–∞–ª–∏—à–µ–Ω–Ω—è –∑–∞—è–≤–∏ –ø—Ä–æ –≤–∏–¥–∞—á—É –¥—É–±–ª—ñ–∫–∞—Ç—É —É—Å—Ç–∞–Ω–æ–≤—á–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –±–µ–∑ —Ä–æ–∑–≥–ª—è–¥—É –≤–∏–¥–∞—î—Ç—å—Å—è (–Ω–∞–¥—Å–∏–ª–∞—î—Ç—å—Å—è –ø–æ—à—Ç–æ–≤–∏–º –≤—ñ–¥–ø—Ä–∞–≤–ª–µ–Ω–Ω—è–º –∑ –æ–ø–∏—Å–æ–º –≤–∫–ª–∞–¥–µ–Ω–Ω—è) –¥–µ—Ä–∂–∞–≤–Ω–∏–º —Ä–µ—î—Å—Ç—Ä–∞—Ç–æ—Ä–æ–º –∑–∞—è–≤–Ω–∏–∫—É.&nbsp;</p>\r\n','–Ω—ñ',0,'',0,'','','',''),(98,'–î–µ—Ä–∂–∞–≤–Ω–∞ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—è –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ –≤ —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ñ –∑–ª–∏—Ç—Ç—è,&nbsp; –ø—Ä–∏—î–¥–Ω–∞–Ω–Ω—è, –ø–æ–¥—ñ–ª—É –∞–±–æ –ø–µ—Ä–µ—Ç–≤–æ—Ä–µ–Ω–Ω—è\r\n',1,17,'<p>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 15.05.2003 ‚Ññ 755-IV &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot; (–∑—ñ&nbsp; –∑–º—ñ–Ω–∞–º–∏&nbsp; —Ç–∞&nbsp; –¥–æ–ø–æ–≤–Ω–µ–Ω–Ω—è–º–∏)&nbsp;(—Å—Ç–∞—Ç—Ç—ñ 8, 37).</p>\r\n','<p>–ó–≤–µ—Ä–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ —É –∑–≤&rsquo;—è–∑–∫—É —ñ–∑ –∑–∞–∫—ñ–Ω—á–µ–Ω–Ω—è–º —Å—Ç—Ä–æ–∫—É –∑–∞—è–≤–ª–µ–Ω–Ω—è –≤–∏–º–æ–≥ –∫—Ä–µ–¥–∏—Ç–æ—Ä–∞–º–∏ —Ç–∞ –ø—Ä–æ—Ü–µ–¥—É—Ä–∏ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏.</p>\r\n','<p>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞—é—Ç—å—Å—è (–Ω–∞–¥—Å–∏–ª–∞—é—Ç—å—Å—è –ø–æ—à—Ç–æ–≤–∏–º&nbsp; –≤—ñ–¥–ø—Ä–∞–≤–ª–µ–Ω–Ω—è–º –∑ –æ–ø–∏—Å–æ–º –≤–∫–ª–∞–¥–µ–Ω–Ω—è) –≥–æ–ª–æ–≤–æ—é –∫–æ–º—ñ—Å—ñ—ó –∑&nbsp; –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è&nbsp; –∞–±–æ&nbsp; —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–æ—é&nbsp; –Ω–µ—é&nbsp; –æ—Å–æ–±–æ—é.</p>\r\n','<ol>\r\n	<li>–ó–∞–ø–æ–≤–Ω–µ–Ω–∞ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π–Ω–∞ –∫–∞—Ä—Ç–∫–∞ –Ω–∞ –ø—Ä–æ–≤–µ–¥–µ–Ω–Ω—è –¥–µ—Ä–∂–∞–≤–Ω–æ—ó —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ –≤&nbsp; —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ñ&nbsp; –∑–ª–∏—Ç—Ç—è, –ø—Ä–∏—î–¥–Ω–∞–Ω–Ω—è, –ø–æ–¥—ñ–ª—É –∞–±–æ –ø–µ—Ä–µ—Ç–≤–æ—Ä–µ–Ω–Ω—è .</li>\r\n	<li>–ü—ñ–¥–ø–∏—Å–∞–Ω–∏–π –≥–æ–ª–æ–≤–æ—é —ñ —á–ª–µ–Ω–∞–º–∏ –∫–æ–º—ñ—Å—ñ—ó –∑ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è&nbsp; —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ —Ç–∞ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–∏–π –∑–∞—Å–Ω–æ–≤–Ω–∏–∫–∞–º–∏ (—É—á–∞—Å–Ω–∏–∫–∞–º–∏) —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ –∞–±–æ –æ—Ä–≥–∞–Ω–æ–º,&nbsp; —è–∫–∏–π –ø—Ä–∏–π–Ω—è–≤ —Ä—ñ—à–µ–Ω–Ω—è –ø—Ä–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏, –ø—Ä–∏–º—ñ—Ä–Ω–∏–∫ –æ—Ä–∏–≥—ñ–Ω–∞–ª—É –ø–µ—Ä–µ–¥–∞–≤–∞–ª—å–Ω–æ–≥–æ –∞–∫—Ç–∞, —è–∫—â–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è –∑–¥—ñ–π—Å–Ω—é—î—Ç—å—Å—è –≤ —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ñ –∑–ª–∏—Ç—Ç—è,&nbsp; –ø—Ä–∏—î–¥–Ω–∞–Ω–Ω—è –∞–±–æ –ø–µ—Ä–µ—Ç–≤–æ—Ä–µ–Ω–Ω—è, —á–∏ —Ä–æ–∑–ø–æ–¥—ñ–ª—å—á–æ–≥–æ&nbsp; –±–∞–ª–∞–Ω—Å—É,&nbsp; —è–∫—â–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è –∑–¥—ñ–π—Å–Ω—é—î—Ç—å—Å—è –≤ —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ñ –ø–æ–¥—ñ–ª—É, –∞–±–æ —ó—Ö –Ω–æ—Ç–∞—Ä—ñ–∞–ª—å–Ω–æ –∑–∞—Å–≤—ñ–¥—á–µ–Ω—ñ –∫–æ–ø—ñ—ó.</li>\r\n	<li>–î–æ–≤—ñ–¥–∫–∞ –∞—Ä—Ö—ñ–≤–Ω–æ—ó —É—Å—Ç–∞–Ω–æ–≤–∏ –ø—Ä–æ –ø—Ä–∏–π–Ω—è—Ç—Ç—è –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤, —è–∫—ñ –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ –∑–∞–∫–æ–Ω—É –ø—ñ–¥–ª—è–≥–∞—é—Ç—å –¥–æ–≤–≥–æ—Å—Ç—Ä–æ–∫–æ–≤–æ–º—É –∑–±–µ—Ä—ñ–≥–∞–Ω–Ω—é*.</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç –ø—Ä–æ —É–∑–≥–æ–¥–∂–µ–Ω–Ω—è –ø–ª–∞–Ω—É —Ä–µ–æ—Ä–≥–∞–Ω—ñ–∑–∞—Ü—ñ—ó&nbsp; –∑&nbsp; –æ—Ä–≥–∞–Ω–æ–º –¥–µ—Ä–∂–∞–≤–Ω–æ—ó –ø–æ–¥–∞—Ç–∫–æ–