Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ —Ç–∞ –ø—Ä–æ –ø–∞—Å–ø–æ—Ä—Ç –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω&raquo; –≤—ñ–¥ 26.06.1992&nbsp;‚Ññ 2503-–•–Ü–Ü</li>\r\n	<li>–°—Ç. 16, 21 –ó–∞–∫–æ–Ω—É –£–∫—Ä–∞—ó–Ω–∏ &nbsp;&laquo;–ü—Ä–æ –Ñ–¥–∏–Ω–∏–π –¥–µ—Ä–∂–∞–≤–Ω–∏–π –¥–µ–º–æ–≥—Ä–∞—Ñ—ñ—á–Ω–∏–π —Ä–µ—î—Å—Ç—Ä —Ç–∞ –¥–æ–∫—É–º–µ–Ω—Ç–∏, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—é—Ç—å –≥—Ä–æ–º–∞–¥—è–Ω—Å—Ç–≤–æ –£–∫—Ä–∞—ó–Ω–∏, –ø–æ—Å–≤—ñ–¥—á—É—é—Ç—å –æ—Å–æ–±—É —á–∏ —ó—ó —Å–ø–µ—Ü—ñ–∞–ª—å–Ω–∏–π —Å—Ç–∞—Ç—É—Å&raquo; –≤—ñ–¥ 20.11.2012 ‚Ññ 5492-V–Ü</li>\r\n	<li>–î–µ–∫—Ä–µ—Ç –ö–∞–±—ñ–Ω–µ—Ç—É –º—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω–µ –º–∏—Ç–æ&raquo; –≤—ñ–¥ 21.01.1993 ‚Ññ 7-93</li>\r\n	<li>–ù–∞–∫–∞–∑ –ú–í–° &laquo;–ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è –ü–æ—Ä—è–¥–∫—É –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è —ñ –≤–∏–¥–∞—á—ñ –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏&raquo; –≤—ñ–¥ 13.04.2012 ‚Ññ 320</li>\r\n</ol>\r\n','<p>–í—Ç—Ä–∞—Ç–∞ —á–∏ –ø–æ—à–∫–æ–¥–∂–µ–Ω–Ω—è –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏.</p>\r\n','<p>–ó–∞—è–≤–Ω–∏–∫ –¥–ª—è –æ–¥–µ—Ä–∂–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–æ—ó –ø–æ—Å–ª—É–≥–∏ –∑ –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è&nbsp; —Ç–∞ –≤–∏–¥–∞—á—ñ –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –∑–∞–º—ñ—Å—Ç—å –≤—Ç—Ä–∞—á–µ–Ω–æ–≥–æ —á–∏ –ø–æ—à–∫–æ–¥–∂–µ–Ω–æ–≥–æ –∑–≤–µ—Ä—Ç–∞—î—Ç—å—Å—è –¥–æ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É –î–ú–° –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ –º—ñ—Å—Ü—è –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è.</p>\r\n','<p>1. –∑–∞—è–≤–∞ –ø—Ä–æ –≤–∏–¥–∞—á—É –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏;</p>\r\n\r\n<p>2. –∞–±–æ —Ç—Ä–∏ —Ñ–æ—Ç–æ–∫–∞—Ä—Ç–∫–∏ —Ä–æ–∑–º—ñ—Ä–æ–º 3,5 —Ö 4,5 —Å–º;</p>\r\n\r\n<p>3. –ø–ª–∞—Ç—ñ–∂–Ω–∏–π –¥–æ–∫—É–º–µ–Ω—Ç –∑ –≤—ñ–¥–º—ñ—Ç–∫–æ—é –±–∞–Ω–∫—É –ø—Ä–æ —Å–ø–ª–∞—Ç—É –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ –º–∏—Ç–∞ –∞–±–æ –∫–æ–ø—ñ—é –¥–æ–∫—É–º–µ–Ω—Ç–∞ –ø—Ä–æ –∑–≤—ñ–ª—å–Ω–µ–Ω–Ω—è –≤—ñ–¥ —Å–ø–ª–∞—Ç–∏ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ –º–∏—Ç–∞;</p>\r\n\r\n<p>4. –¥–æ–∫—É–º–µ–Ω—Ç–∏, –Ω–∞ –ø—ñ–¥—Å—Ç–∞–≤—ñ —è–∫–∏—Ö —É –ø–∞—Å–ø–æ—Ä—Ç—ñ –ø—Ä–æ—Å—Ç–∞–≤–ª—è—é—Ç—å—Å—è –≤—ñ–¥–ø–æ–≤—