è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω&raquo; –≤—ñ–¥ 26.06.1992&nbsp;‚Ññ 2503-–•–Ü–Ü</li>\r\n	<li>–ù–∞–∫–∞–∑ –ú–í–° &laquo;–ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è –ü–æ—Ä—è–¥–∫—É –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è —ñ –≤–∏–¥–∞—á—ñ –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏&raquo; –≤—ñ–¥ 13.04.2012 ‚Ññ 320</li>\r\n</ol>\r\n','<p>–î–æ—Å—è–≥–Ω–µ–Ω–Ω—è 25- —ñ 45- —Ä—ñ—á–Ω–æ–≥–æ –≤—ñ–∫—É.</p>\r\n','<p>–ó–∞—è–≤–Ω–∏–∫ –¥–ª—è –æ–¥–µ—Ä–∂–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–æ—ó –ø–æ—Å–ª—É–≥–∏ –∑–≤–µ—Ä—Ç–∞—î—Ç—å—Å—è –¥–æ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É –î–ú–° –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ –º—ñ—Å—Ü—è –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è.</p>\r\n','<ol>\r\n	<li>–ó–∞—è–≤–∞</li>\r\n	<li>2 —Ñ–æ—Ç–æ–∫–∞—Ä—Ç–∫–∏ —Ä–æ–∑–º—ñ—Ä–æ–º 3,5 —Ö 4,5 —Å–º.</li>\r\n	<li>–ü–∞—Å–ø–æ—Ä—Ç –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏.</li>\r\n</ol>\r\n',0,'','','','<p>–ù–µ –ø—ñ–∑–Ω—ñ—à–µ 5 –¥–Ω—ñ–≤ –∑ –¥–∞—Ç–∏ –ø–æ–¥–∞–Ω–Ω—è –∑–∞—è–≤–Ω–∏–∫–æ–º –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤.</p>\r\n','<p>–í—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –æ–¥–Ω–æ–≥–æ –∑ –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤, –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö –¥–ª—è –æ—Ç—Ä–∏–º–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–æ—ó –ø–æ—Å–ª—É–≥–∏.</p>\r\n','<p>–í–∏–¥–∞—á–∞ –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏.</p>\r\n','<p>–ó–≤–µ—Ä–Ω—É—Ç–∏—Å—è –¥–æ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É –î–ú–° –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –∑–∞ –º—ñ—Å—Ü–µ–º –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è.</p>\r\n','–Ω—ñ',0,'',0,'','','',''),(115,'–†–µ—î—Å—Ç—Ä–∞—Ü—ñ—è –º—ñ—Å—Ü—è –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è / –ø–µ—Ä–µ–±—É–≤–∞–Ω–Ω—è\r\n',1,19,'<ol>\r\n	<li>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ —Å–≤–æ–±–æ–¥—É –ø–µ—Ä–µ—Å—É–≤–∞–Ω–Ω—è —Ç–∞ –≤—ñ–ª—å–Ω–∏–π –≤–∏–±—ñ—Ä –º—ñ—Å—Ü—è –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è –≤ –£–∫—Ä–∞—ó–Ω—ñ&raquo; –≤—ñ–¥ 11.12.2003 ‚Ññ 1382-–ÜV.</li>\r\n	<li>–ù–∞–∫–∞–∑ –ú–í–° &laquo;–ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è –ü–æ—Ä—è–¥–∫—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –º—ñ—Å—Ü—è –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è —Ç–∞ –º—ñ—Å—Ü—è –ø–µ—Ä–µ–±—É–≤–∞–Ω–Ω—è —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± –≤ –£–∫—Ä–∞—ó–Ω—ñ —Ç–∞ –∑—Ä–∞–∑–∫—ñ–≤ –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤&raquo; –≤—ñ–¥ 22.11.20