 –∞–±–æ –ø–µ—Ä–µ–±—É–≤–∞—é—Ç—å –Ω–∞ –≤—ñ–π—Å—å–∫–æ–≤–æ–º—É –æ–±–ª—ñ–∫—É)</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; 7. –£ —Ä–∞–∑—ñ –ø–æ–¥–∞—á—ñ –∑–∞—è–≤–∏ –∑–∞–∫–æ–Ω–Ω–∏–º –ø—Ä–µ–¥—Å—Ç–∞–≤–Ω–∏–∫–æ–º –æ—Å–æ–±–∏ –¥–æ–¥–∞—Ç–∫–æ–≤–æ –ø–æ–¥–∞—é—Ç—å—Å—è:</p>\r\n\r\n<ul>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø–æ—Å–≤—ñ–¥—á—É—î –æ—Å–æ–±—É –∑–∞–∫–æ–Ω–Ω–æ–≥–æ –ø—Ä–µ–¥—Å—Ç–∞–≤–Ω–∏–∫–∞;</li>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–Ω—è –æ—Å–æ–±–∏ —è–∫ –∑–∞–∫–æ–Ω–Ω–æ–≥–æ –ø—Ä–µ–¥—Å—Ç–∞–≤–Ω–∏–∫–∞, –∫—Ä—ñ–º –≤–∏–ø–∞–¥–∫—ñ–≤, –∫–æ–ª–∏ –∑–∞–∫–æ–Ω–Ω–∏–º–∏ –ø—Ä–µ–¥—Å—Ç–∞–≤–Ω–∏–∫–∞–º–∏ —î –±–∞—Ç—å–∫–∏ (—É—Å–∏–Ω–æ–≤–ª—é–≤–∞—á—ñ).</li>\r\n</ul>\r\n',0,'','','','<p>–ó–Ω—è—Ç—Ç—è –∑ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –º—ñ—Å—Ü—è –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è –∑–¥—ñ–π—Å–Ω—é—î—Ç—å—Å—è –≤ –¥–µ–Ω—å –ø–æ–¥–∞–Ω–Ω—è –æ—Å–æ–±–æ—é –¥–æ–∫—É–º–µ–Ω—Ç—ñ.</p>\r\n','<p>–í—ñ–¥—Å—É—Ç–Ω—ñ—Å—Ç—å –æ–¥–Ω–æ–≥–æ –∑ –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤, –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö –¥–ª—è –æ—Ç—Ä–∏–º–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–æ—ó –ø–æ—Å–ª—É–≥–∏.</p>\r\n','<p>–ó–Ω—è—Ç—Ç—è –∑ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –º—ñ—Å—Ü—è –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è –æ—Å–æ–±–∏.</p>\r\n','<p>–ó–≤–µ—Ä–Ω—É—Ç–∏—Å—è &nbsp;–¥–æ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É –î–ú–° –∞–±–æ —Ü–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥ –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ –¥–æ –º—ñ—Å—Ü—è –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è.</p>\r\n','–Ω—ñ',0,'',0,'','','',''),(117,'–û—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è —Ç–∞ –≤–∏–¥–∞—á–∞ –∞–±–æ –æ–±–º—ñ–Ω –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω\r\n',1,19,'<ol>\r\n	<li>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ –ø–æ—Ä—è–¥–æ–∫ –≤–∏—ó–∑–¥—É –∑ –£–∫—Ä–∞—ó–Ω–∏ —ñ –≤&rsquo;—ó–∑–¥—É –≤ –£–∫—Ä–∞—ó–Ω—É –≥—Ä–æ–º–∞–¥—è–Ω –£–∫—Ä–∞—ó–Ω–∏&raquo;&nbsp; –≤—ñ–¥ 21.01.1994 ‚Ññ 3857-–•–Ü–Ü.</li>\r\n	<li>–ü–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ –ø–∞—Å–ø–æ—Ä—Ç –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–µ –ü–æ—Å—Ç–∞–Ω–æ–≤–æ—é –í–µ—Ä—Ö–æ–≤–Ω–æ—ó –†–∞–¥–∏ –£–∫—Ä–∞—ó–Ω–∏ 23.02.2007 ‚Ññ 719-V.</li>\r\n	<li>–ü—Ä–∞–≤–∏–ª–∞ –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è —Ç–∞ –≤–∏–¥–∞—á—ñ –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω —ñ –ø—Ä–æ—ó–∑–Ω–æ–≥–æ –¥–æ–∫—É–º–µ–Ω—Ç–∞ –¥–∏—Ç–∏–Ω–∏, —ó—Ö —Ç–∏–º—á–∞—Å–æ–≤–æ–≥–æ –∑–∞—Ç—Ä–∏–º–∞–Ω–Ω—è —Ç–∞ –≤–∏–ª—É—á–µ–Ω–Ω—è, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω—ñ –ø–æ—Å—Ç–∞–Ω–æ–≤–æ—é –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 31 –±–µ—Ä–µ–∑–Ω—è 1995 —Ä–æ–∫—É ‚Ññ 231.</li>\r\n	<li>–ü–æ—Ä—è–¥–æ–∫ –ø—Ä–æ–≤–∞–¥–∂–µ–Ω–Ω—è –∑–∞ –∑–∞—è–≤–∞–º–∏ –ø—Ä–æ –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è –ø–∞—Å–ø–æ—Ä—Ç—ñ–≤ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω —ñ –ø—Ä–æ—ó–∑–Ω–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –¥–∏—Ç–∏–Ω–∏, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–∏–π –ù–∞–∫–∞–∑–æ–º –ú–í–° –≤—ñ–¥ 21.12.2004&nbsp; ‚Ññ 1603.</li>\r\n</ol>\r\n','<p>–ó–∞—è–≤–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏.</p>\r\n','<p>–ó–∞—è–≤–Ω–∏–∫ &nbsp;–¥–ª—è –æ–¥–µ—Ä–∂–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–æ—ó –ø–æ—Å–ª—É–≥–∏ –∑ –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è –∑–Ω—è—Ç—Ç—è –∑ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—ó –∑–≤–µ—Ä—Ç–∞—î—Ç—å—Å—è –¥–æ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –æ—Ä–≥–∞–Ω—É (–ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É) –î–ú–° &nbsp;–∞–±–æ –¶–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥ –û–¥–µ—Å—å–∫–æ—ó –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏.&nbsp;</p>\r\n','<ol>\r\n	<li>–ó–∞—è–≤–∞-–∞–Ω–∫–µ—Ç–∞ –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–≥–æ –∑—Ä–∞–∑–∫–∞ (–∑–∞–ø–æ–≤–Ω—é—î—Ç—å—Å—è –ø–æ—Å–∞–¥–æ–≤–æ—é –æ—Å–æ–±–æ—é —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –æ—Ä–≥–∞–Ω—É (–ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É) –î–ú–°, –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–æ—Ä–æ–º —Ü–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥,</li>\r\n	<li>–ü–∞—Å–ø–æ—Ä—Ç –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏, —Å–≤—ñ–¥–æ—Ü—Ç–≤–æ –ø—Ä–æ –Ω–∞—Ä–æ–¥–∂–µ–Ω–Ω—è (–¥–ª—è –æ—Å—ñ–± –≤—ñ–∫–æ–º –¥–æ 16 —Ä–æ–∫—ñ–≤) (–ø—ñ—Å–ª—è –ø—Ä–∏–π–Ω—è—Ç—Ç—è –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –ø–æ–≤–µ—Ä—Ç–∞—î—Ç—å—Å—è)</li>\r\n	<li>–ö–æ–ø—ñ—è –¥–æ–∫—É–º–µ–Ω—Ç–∞ –ø—Ä–æ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —É –î–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø–ª–∞—Ç–Ω–∏–∫—ñ–≤ –ø–æ–¥–∞—Ç–∫—ñ–≤, –≤–∏–¥–∞–Ω–æ–≥–æ –æ—Ä–≥–∞–Ω–∞–º–∏ –¥–µ—Ä–∂–∞–≤–Ω–æ—ó –ø–æ–¥–∞—Ç–∫–æ–≤–æ—ó —Å–ª—É–∂–±–∏, –∫—Ä—ñ–º –æ—Å—ñ–±, —è–∫—ñ —á–µ—Ä–µ–∑ —Å–≤–æ—ó —Ä–µ–ª—ñ–≥—ñ–π–Ω—ñ –∞–±–æ —ñ–Ω—à—ñ –ø–µ—Ä–µ–∫–æ–Ω–∞–Ω–Ω—è –≤—ñ–¥–º–æ–≤–ª—è—é—Ç—å—Å—è –≤—ñ–¥ –ø—Ä–∏–π–Ω—è—Ç—Ç—è —ñ–¥–µ–Ω—Ç–∏—Ñ—ñ–∫–∞—Ü—ñ–π–Ω–æ–≥–æ –Ω–æ–º–µ—Ä–∞ —Ç–∞ –æ—Ñ—ñ—Ü—ñ–π–Ω–æ –ø–æ–≤—ñ–¥–æ–º–ª—è—é—Ç—å –ø—Ä–æ —Ü–µ –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω—ñ –¥–µ—Ä–∂–∞–≤–Ω—ñ –æ—Ä–≥–∞–Ω–∏,</li>\r\n	<li>–ö–≤–∏—Ç–∞–Ω—Ü—ñ—è –ø—Ä–æ —Å–ø–ª–∞—Ç—É –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ –º–∏—Ç–∞ –∞–±–æ –¥–æ–∫—É–º–µ–Ω—Ç, —â–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –ø—Ä–∞–≤–æ –Ω–∞ –∑–≤—ñ–ª—å–Ω–µ–Ω–Ω—è –≤—ñ–¥ –π–æ–≥–æ —Å–ø–ª–∞—Ç–∏,</li>\r\n	<li>–ö–≤–∏—Ç–∞–Ω—Ü—ñ—é –ø—Ä–æ –æ–ø–ª–∞—Ç—É —ñ–Ω—à–∏—Ö –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–∏—Ö –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤–æ–º –ø–ª–∞—Ç–µ–∂—ñ–≤.&nbsp;</li>\r\n	<li>–û—Å–æ–±–∏ –≤—ñ–∫–æ–º –≤—ñ–¥ 18 –¥–æ 25 —Ä–æ–∫—ñ–≤, —è–∫—ñ –ø—ñ–¥–ª—è–≥–∞—é—Ç—å –ø—Ä–∏–∑–æ–≤—É –Ω–∞ —Å—Ç—Ä–æ–∫–æ–≤—É –≤—ñ–π—Å—å–∫–æ–≤—É —Å–ª—É–∂–±—É —Ä–∞–∑–æ–º —ñ–∑ –∑–∞—è–≤–æ—é&nbsp; –ø—Ä–æ –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è –ø–∞—Å–ø–æ—Ä—Ç–∞ –ø–æ–¥–∞—é—Ç—å –¥–æ–≤—ñ–¥–∫—É –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ–≥–æ –≤—ñ–π—Å—å–∫–æ–≤–æ–≥–æ –∫–æ–º—ñ—Å–∞—Ä—ñ–∞—Ç—É —â–æ–¥–æ –º–æ–∂–ª–∏–≤–æ—Å—Ç—ñ –≤–∏—ó–∑–¥—É –∑ –£–∫—Ä–∞—ó–Ω–∏.&nbsp;&nbsp;</li>\r\n</ol>\r\n',1,'<ol>\r\n	<li>–î–µ–∫—Ä–µ—Ç –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω–µ –º–∏—Ç–æ&raquo; –≤—ñ–¥&nbsp;&nbsp; 21.01.1993 ‚Ññ 7.</li>\r\n	<li>–ü–æ—Å—Ç–∞–Ω–æ–≤–∞ –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏&nbsp; &laquo;–î–µ—è–∫—ñ –ø–∏—Ç–∞–Ω–Ω—è –Ω–∞–¥–∞–Ω–Ω—è –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª–∞–º–∏ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ –≤–Ω—É—Ç—Ä—ñ—à–Ω—ñ—Ö —Å–ø—Ä–∞–≤ —Ç–∞ –î–µ—Ä–∂–∞–≤–Ω–æ—ó –º—ñ–≥—Ä–∞—Ü—ñ–π–Ω–æ—ó —Å–ª—É–∂–±–∏&nbsp; –ø–ª–∞—Ç–Ω–∏—Ö –ø–æ—Å–ª—É–≥&raquo; –≤—ñ–¥ 26.10.2011 ‚Ññ 1098.</li>\r\n	<li>–ü–æ—Å—Ç–∞–Ω–æ–≤–∞ –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏&nbsp; &laquo;–ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è –ø–µ—Ä–µ–ª—ñ–∫—É –ø–ª–∞—Ç–Ω–∏—Ö –ø–æ—Å–ª—É–≥, —è–∫—ñ –Ω–∞–¥–∞—é—Ç—å—Å—è –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª–∞–º–∏ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ –≤–Ω—É—Ç—Ä—ñ—à–Ω—ñ—Ö —Å–ø—Ä–∞–≤ —Ç–∞ –î–µ—Ä–∂–∞–≤–Ω–æ—ó –º—ñ–≥—Ä–∞—Ü—ñ–π–Ω–æ—ó —Å–ª—É–∂–±–∏ —ñ —Ä–æ–∑–º—ñ—Ä—É –ø–ª–∞—Ç–∏ –∑–∞ —ó—Ö –Ω–∞–¥–∞–Ω–Ω—è&raquo; –≤—ñ–¥ 04.06.2007 ‚Ññ 795.</li>\r\n</ol>\r\n','<p>–î–µ—Ä–∂–∞–≤–Ω–µ –º–∏—Ç–æ &ndash; 10 –Ω–µ–æ–ø–æ–¥–∞—Ç–∫–æ–≤—É–≤–∞–Ω–∏—Ö –º—ñ–Ω—ñ–º—É–º—ñ–≤ –¥–æ—Ö–æ–¥—ñ–≤ –≥—Ä–æ–º–∞–¥—è–Ω</p>\r\n\r\n<p>–†–æ–∑–º—ñ—Ä –ø–ª–∞—Ç–∏ –∑–∞ –Ω–∞–¥–∞–Ω–Ω—è –ø–æ—Å–ª—É–≥–∏ &ndash; 87,15 –≥—Ä–Ω.</p>\r\n\r\n<p>–í–∞—Ä—Ç—ñ—Å—Ç—å –±–ª–∞–Ω–∫–∞ –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω (–≤–∏–∑–Ω–∞—á–∞—î—Ç—å—Å—è –∑ —É—Ä–∞—Ö—É–≤–∞–Ω–Ω—è–º –≤–∏—Ç—Ä–∞—Ç, –ø–æ–≤&rsquo;—è–∑–∞–Ω–∏—Ö –∑ –ø—Ä–∏–¥–±–∞–Ω–Ω—è–º –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ—ó –ø—Ä–æ–¥—É–∫—Ü—ñ—ó, —É —Ç–æ–º—É —á–∏—Å–ª—ñ –≤–∞—Ä—Ç–æ—Å—Ç—ñ –ø–µ—Ä—Å–æ–Ω–∞–ª—ñ–∑–∞—Ü—ñ—ó).</p>\r\n','<p>---</p>\r\n','<p>–ù–µ –ø—ñ–∑–Ω—ñ—à–µ 20 —Ä–æ–±–æ—á–∏—Ö –¥–Ω—ñ–≤ –∑ –¥–∞—Ç–∏ –ø–æ–¥–∞–Ω–Ω—è –∑–∞—è–≤–Ω–∏–∫–æ–º –Ω–µ–æ–±—Ö—ñ–¥–Ω–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤.</p>\r\n','<p>–ì—Ä–æ–º–∞–¥—è–Ω–∏–Ω—É –º–æ–∂–µ –±—É—Ç–∏ —Ç–∏–º—á–∞—Å–æ–≤–æ –≤—ñ–¥–º–æ–≤–ª–µ–Ω–æ —É —Ä–∞–∑—ñ, –∫–æ–ª–∏:&nbsp;</p>\r\n\r\n<ol>\r\n	<li>–≤—ñ–Ω –æ–±—ñ–∑–Ω–∞–Ω–∏–π –∑ –≤—ñ–¥–æ–º–æ—Å—Ç—è–º–∏, —â–æ —Å—Ç–∞–Ω–æ–≤–ª—è—Ç—å –¥–µ—Ä–∂–∞–≤–Ω—É —Ç–∞—î–º–Ω–∏—Ü—é, - –¥–æ –∑–∞–∫—ñ–Ω—á–µ–Ω–Ω—è —Å—Ç—Ä–æ–∫—É, –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–≥–æ –∑–∞–∫–æ–Ω–æ–º –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ç–∞—î–º–Ω–∏—Ü—é&raquo; (—É —Ä–∞–∑—ñ –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω –Ω–∞ –ø–æ—Å—Ç—ñ–π–Ω–µ –ø—Ä–æ–∂–∏–≤–∞–Ω–Ω—è).</li>\r\n	<li>–¥—ñ—é—Ç—å –Ω–µ–≤—Ä–µ–≥—É–ª—å–æ–≤–∞–Ω—ñ –∞–ª—ñ–º–µ–Ω—Ç–Ω—ñ, –¥–æ–≥–æ–≤—ñ—Ä–Ω—ñ —á–∏ —ñ–Ω—à—ñ&nbsp; –Ω–µ–≤–∏–∫–æ–Ω–∞–Ω—ñ –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω–Ω—è, - –¥–æ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω—å –∞–±–æ –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω–Ω—è —Å–ø–æ—Ä—É –∑–∞ –ø–æ–≥–æ–¥–∂–µ–Ω–Ω—è–º —Å—Ç–æ—Ä—ñ–Ω —É –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–∏—Ö –∑–∞–∫–æ–Ω–æ–º –≤–∏–ø–∞–¥–∫–∞—Ö, —á–∏ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω—å –∑–∞—Å—Ç–∞–≤–æ—é, —è–∫—â–æ —ñ–Ω—à–µ –Ω–µ –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–æ –º—ñ–∂–Ω–∞—Ä–æ–¥–Ω–∏–º –¥–æ–≥–æ–≤–æ—Ä–æ–º –£–∫—Ä–∞—ó–Ω–∏;</li>\r\n	<li>—Å—Ç–æ—Å–æ–≤–Ω–æ –Ω—å–æ–≥–æ –≤ –ø–æ—Ä—è–¥–∫—É, –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–æ–º—É –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–∏–º –ø—Ä–æ—Ü–µ—Å—É–∞–ª—å–Ω–∏–º –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤–æ–º, –∑–∞—Å—Ç–æ—Å–æ–≤–∞–Ω–æ –∑–∞–ø–æ–±—ñ–∂–Ω–∏–π –∑–∞—Ö—ñ–¥, –∑–∞ —É–º–æ–≤–∞–º–∏ —è–∫–æ–≥–æ –π–æ–º—É –∑–∞–±–æ—Ä–æ–Ω–µ–Ω–æ –≤–∏—ó–∂–¥–∂–∞—Ç–∏ –∑–∞ –∫–æ—Ä–¥–æ–Ω, - –¥–æ –∑–∞–∫—ñ–Ω—á–µ–Ω–Ω—è –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–æ–≥–æ –ø—Ä–æ–≤–∞–¥–∂–µ–Ω–Ω—è –∞–±–æ —Å–∫–∞—Å—É–≤–∞–Ω–Ω—è –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–∏—Ö –æ–±–º–µ–∂–µ–Ω—å;</li>\r\n	<li>–≤—ñ–Ω –∑–∞—Å—É–¥–∂–µ–Ω–∏–π –∑–∞ –≤—á–∏–Ω–µ–Ω–Ω—è –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–æ–≥–æ –ø—Ä–∞–≤–æ–ø–æ—Ä—É—à–µ–Ω–Ω—è, - –¥–æ –≤—ñ–¥–±—É—Ç—Ç—è –ø–æ–∫–∞—Ä–∞–Ω–Ω—è –∞–±–æ –∑–≤—ñ–ª—å–Ω–µ–Ω–Ω—è</li>\r\n	<li>–≤—ñ–Ω —É—Ö–∏–ª—è—î—Ç—å—Å—è –≤—ñ–¥ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω—å, –ø–æ–∫–ª–∞–¥–µ–Ω–∏—Ö –Ω–∞ –Ω—å–æ–≥–æ —Å—É–¥–æ–≤–∏–º —Ä—ñ—à–µ–Ω–Ω—è–º, —Ä—ñ—à–µ–Ω–Ω—è–º —ñ–Ω—à–æ–≥–æ –æ—Ä–≥–∞–Ω—É (–ø–æ—Å–∞–¥–æ–≤–æ—ó –æ—Å–æ–±–∏), - –¥–æ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω—å;</li>\r\n	<li>–≤—ñ–Ω —Å–≤—ñ–¥–æ–º–æ —Å–ø–æ–≤—ñ—Å—Ç–∏–≤ –ø—Ä–æ —Å–µ–±–µ –Ω–µ–ø—Ä–∞–≤–¥–∏–≤—ñ –≤—ñ–¥–æ–º–æ—Å—Ç—ñ, - –¥–æ –∑&rsquo;—è—Å—É–≤–∞–Ω–Ω—è –ø—Ä–∏—á–∏–Ω —ñ –Ω–∞—Å–ª—ñ–¥–∫—ñ–≤ –ø–æ–¥–∞–Ω–Ω—è –Ω–µ–ø—Ä–∞–≤–¥–∏–≤–∏—Ö –≤—ñ–¥–æ–º–æ—Å—Ç–µ–π;</li>\r\n	<li>–≤—ñ–Ω –ø—ñ–¥–ª—è–≥–∞—î –ø—Ä–∏–∑–æ–≤—É –Ω–∞ —Å—Ç—Ä–æ–∫–æ–≤—É –≤—ñ–π—Å—å–∫–æ–≤—É —Å–ª—É–∂–±—É, - –¥–æ –≤–∏—Ä—ñ—à–µ–Ω–Ω—è –ø–∏—Ç–∞–Ω–Ω—è –ø—Ä–æ –≤—ñ–¥—Å—Ç—Ä–æ—á–∫—É –≤—ñ–¥ –ø—Ä–∏–∑–æ–≤—É;</li>\r\n	<li>—â–æ–¥–æ –Ω—å–æ–≥–æ –ø–æ–¥–∞–Ω–æ —Ü–∏–≤—ñ–ª—å–Ω–∏–π –ø–æ–∑–æ–≤ –¥–æ —Å—É–¥—É, - –¥–æ –∑–∞–∫—ñ–Ω—á–µ–Ω–Ω—è –ø—Ä–æ–≤–∞–¥–∂–µ–Ω–Ω—è —É —Å–ø—Ä–∞–≤—ñ;</li>\r\n	<li>–≤—ñ–Ω –ø–µ—Ä–µ–±—É–≤–∞—î –ø—ñ–¥ –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏–º –Ω–∞–≥–ª—è–¥–æ–º –æ—Ä–≥–∞–Ω—ñ–≤ –≤–Ω—É—Ç—Ä—ñ—à–Ω—ñ—Ö —Å–ø—Ä–∞–≤, -&nbsp; –¥–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è –Ω–∞–≥–ª—è–¥—É.&nbsp;</li>\r\n</ol>\r\n','<p>–í–∏–¥–∞—á–∞ –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω—É –£–∫—Ä–∞—ó–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω.</p>\r\n','<p>–ó–≤–µ—Ä–Ω—É—Ç–∏—Å—è &nbsp;–¥–æ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –æ—Ä–≥–∞–Ω—É (–ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É) –î–ú–° –∞–±–æ —Ü–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥.</p>\r\n','–Ω—ñ',0,'',0,'','','',''),(118,'–û—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è —Ç–∞ –≤–∏–¥–∞—á–∞ –ø—Ä–æ—ó–∑–Ω–æ–≥–æ –¥–æ–∫—É–º–µ–Ω—Ç—É –¥–∏—Ç–∏–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω\r\n',1,19,'<ol>\r\n	<li>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ &laquo;–ü—Ä–æ –ø–æ—Ä—è–¥–æ–∫ –≤–∏—ó–∑–¥—É –∑ –£–∫—Ä–∞—ó–Ω–∏ —ñ –≤&rsquo;—ó–∑–¥—É –≤ –£–∫—Ä–∞—ó–Ω—É –≥—Ä–æ–º–∞–¥—è–Ω –£–∫—Ä–∞—ó–Ω–∏&raquo;&nbsp; –≤—ñ–¥ 21.01.1994 ‚Ññ 3857.</li>\r\n	<li>–ü–æ–ª–æ–∂–µ–Ω–Ω—è –ø—Ä–æ –ø—Ä–æ—ó–∑–Ω–∏–π –¥–æ–∫—É–º–µ–Ω—Ç –¥–∏—Ç–∏–Ω–∏, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–µ&nbsp; –£–∫–∞–∑–æ–º –ü—Ä–µ–∑–∏–¥–µ–Ω—Ç–∞ –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 07.09.1994 &nbsp;‚Ññ 503.</li>\r\n	<li>–ü—Ä–∞–≤–∏–ª–∞ –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è —Ç–∞ –≤–∏–¥–∞—á—ñ –ø–∞—Å–ø–æ—Ä—Ç–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω —ñ –ø—Ä–æ—ó–∑–Ω–æ–≥–æ –¥–æ–∫—É–º–µ–Ω—Ç–∞ –¥–∏—Ç–∏–Ω–∏, —ó—Ö —Ç–∏–º—á–∞—Å–æ–≤–æ–≥–æ –∑–∞—Ç—Ä–∏–º–∞–Ω–Ω—è —Ç–∞ –≤–∏–ª—É—á–µ–Ω–Ω—è, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω—ñ –ø–æ—Å—Ç–∞–Ω–æ–≤–æ—é –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ &nbsp; 31.03. 1995 —Ä–æ–∫—É ‚Ññ 231.</li>\r\n	<li>–ü–æ—Ä—è–¥–æ–∫ –ø—Ä–æ–≤–∞–¥–∂–µ–Ω–Ω—è –∑–∞ –∑–∞—è–≤–∞–º–∏ –ø—Ä–æ –æ—Ñ–æ—Ä–º–ª–µ–Ω–Ω—è –ø–∞—Å–ø–æ—Ä—Ç—ñ–≤ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω —ñ –ø—Ä–æ—ó–∑–Ω–∏—Ö –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –¥–∏—Ç–∏–Ω–∏, –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–∏–π –ù–∞–∫–∞–∑–æ–º –ú–í–° –≤—ñ–¥ 21.12.2004&nbsp; ‚Ññ 1603.</li>\r\n</ol>\r\n','<p>–ó–∞—è–≤–∞ –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏.</p>\r\n','<p>–ó–∞—è–≤–Ω–∏–∫ &nbsp;–¥–ª—è –æ–¥–µ—Ä–∂–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–æ—ó –ø–æ—Å–ª—É–≥–∏ –∑–≤–µ—Ä—Ç–∞—î—Ç—å—Å—è –¥–æ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –æ—Ä–≥–∞–Ω—É (–ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É) –î–ú–° &nbsp;–∞–±–æ –¶–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥ –û–¥–µ—Å—å–∫–æ—ó –º—ñ—Å—å–∫–æ—ó —Ä–∞–¥–∏.&nbsp;</p>\r\n','<ol>\r\n	<li>–ó–∞—è–≤–∞-–∞–Ω–∫–µ—Ç–∞ –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ–≥–æ –∑—Ä–∞–∑–∫–∞.</li>\r\n	<li>–ù–æ—Ç–∞—Ä—ñ–∞–ª—å–Ω–µ –∑–∞—Å–≤—ñ–¥—á–µ–Ω–µ –∫–ª–æ–ø–æ—Ç–∞–Ω–Ω—è –±–∞—Ç—å–∫—ñ–≤ –∞–±–æ –∑–∞–∫–æ–Ω–Ω–∏—Ö –ø—Ä–µ–¥—Å—Ç–∞–≤–Ω–∏–∫—ñ–≤ —á–∏ –¥—ñ—Ç–µ–π</li>\r\n	<li>–ü–∞—Å–ø–æ—Ä—Ç –≥—Ä–æ–º–∞–¥—è–Ω–∏–Ω–∞ –£–∫—Ä–∞—ó–Ω–∏, —Å–≤—ñ–¥–æ—Ü—Ç–≤–æ –ø—Ä–æ –Ω–∞—Ä–æ–¥–∂–µ–Ω–Ω—è (–¥–ª—è –æ—Å—ñ–± –≤—ñ–∫–æ–º –¥–æ 16 —Ä–æ–∫—ñ–≤) (–ø—ñ—Å–ª—è –ø—Ä–∏–π–Ω—è—Ç—Ç—è –¥–æ–∫—É–º–µ–Ω—Ç—ñ–≤ –ø–æ–≤–µ—Ä—Ç–∞—î—Ç—å—Å—è).</li>\r\n	<li>–ö–æ–ø—ñ—è –¥–æ–∫—É–º–µ–Ω—Ç–∞ –ø—Ä–æ —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —É –î–µ—Ä–∂–∞–≤–Ω–æ–º—É —Ä–µ—î—Å—Ç—Ä—ñ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø–ª–∞—Ç–Ω–∏–∫—ñ–≤ –ø–æ–¥–∞—Ç–∫—ñ–≤, –≤–∏–¥–∞–Ω–æ–≥–æ –æ—Ä–≥–∞–Ω–∞–º–∏ –¥–µ—Ä–∂–∞–≤–Ω–æ—ó –ø–æ–¥–∞—Ç–∫–æ–≤–æ—ó —Å–ª—É–∂–±–∏, –∫—Ä—ñ–º –æ—Å—ñ–±, —è–∫—ñ —á–µ—Ä–µ–∑ —Å–≤–æ—ó —Ä–µ–ª—ñ–≥—ñ–π–Ω—ñ –∞–±–æ —ñ–Ω—à—ñ –ø–µ—Ä–µ–∫–æ–Ω–∞–Ω–Ω—è –≤—ñ–¥–º–æ–≤–ª—è—é—Ç—å—Å—è –≤—ñ–¥ –ø—Ä–∏–π–Ω—è—Ç—Ç—è —ñ–¥–µ–Ω—Ç–∏—Ñ—ñ–∫–∞—Ü—ñ–π–Ω–æ–≥–æ –Ω–æ–º–µ—Ä–∞ —Ç–∞ –æ—Ñ—ñ—Ü—ñ–π–Ω–æ –ø–æ–≤—ñ–¥–æ–º–ª—è—é—Ç—å –ø—Ä–æ —Ü–µ –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω—ñ –¥–µ—Ä–∂–∞–≤–Ω—ñ –æ—Ä–≥–∞–Ω–∏.</li>\r\n	<li>–ö–≤–∏—Ç–∞–Ω—Ü—ñ—ó –ø—Ä–æ –æ–ø–ª–∞—Ç—É –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–∏—Ö –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤–æ–º –ø–ª–∞—Ç–µ–∂—ñ–≤.&nbsp;&nbsp;</li>\r\n</ol>\r\n',1,'<ol>\r\n	<li>–ü–æ—Å—Ç–∞–Ω–æ–≤–∞ –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏&nbsp; &laquo;–î–µ—è–∫—ñ –ø–∏—Ç–∞–Ω–Ω—è –Ω–∞–¥–∞–Ω–Ω—è –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª–∞–º–∏ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ –≤–Ω—É—Ç—Ä—ñ—à–Ω—ñ—Ö —Å–ø—Ä–∞–≤ —Ç–∞ –î–µ—Ä–∂–∞–≤–Ω–æ—ó –º—ñ–≥—Ä–∞—Ü—ñ–π–Ω–æ—ó —Å–ª—É–∂–±–∏&nbsp; –ø–ª–∞—Ç–Ω–∏—Ö –ø–æ—Å–ª—É–≥&raquo; –≤—ñ–¥ 26.10.2011 ‚Ññ 1098.</li>\r\n	<li>–ü–æ—Å—Ç–∞–Ω–æ–≤–∞ –ö–∞–±—ñ–Ω–µ—Ç—É –ú—ñ–Ω—ñ—Å—Ç—Ä—ñ–≤ –£–∫—Ä–∞—ó–Ω–∏&nbsp; &laquo;–ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è –ø–µ—Ä–µ–ª—ñ–∫—É –ø–ª–∞—Ç–Ω–∏—Ö –ø–æ—Å–ª—É–≥, —è–∫—ñ –Ω–∞–¥–∞—é—Ç—å—Å—è –ø—ñ–¥—Ä–æ–∑–¥—ñ–ª–∞–º–∏ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ –≤–Ω—É—Ç—Ä—ñ—à–Ω—ñ—Ö —Å–ø—Ä–∞–≤ —Ç–∞ –î–µ—Ä–∂–∞–≤–Ω–æ—ó –º—ñ–≥—Ä–∞—Ü—ñ–π–Ω–æ—ó —Å–ª—É–∂–±–∏ —ñ —Ä–æ–∑–º—ñ—Ä—É –ø–ª–∞—Ç–∏ –∑–∞ —ó—Ö –Ω–∞–¥–∞–Ω–Ω—è&raquo; –≤—ñ–¥ 04.06.2007 ‚Ññ 795.</li>\r\n</ol>\r\n','<p>–†–æ–∑–º—ñ—Ä –ø–ª–∞—Ç–∏ –∑–∞ –Ω–∞–¥–∞–Ω–Ω—è –ø–æ—Å–ª—É–≥–∏ &ndash; 30,35 –≥—Ä–Ω, —É —Ä–∞–∑—ñ –Ω–∞–¥–∞–Ω–Ω—è –ø–æ—Å–ª—É–≥–∏ –≤ —Å—Ç—Ä–æ–∫ –¥–æ 10 –¥–Ω—ñ–≤ &ndash; 60,70 –≥—Ä–Ω.</p>\r\n\r\n<p>–í–∞—Ä—Ç—ñ—Å—Ç—å –±–ª–∞–Ω–∫–∞ &ndash; –≤–∏–∑–Ω–∞—á–∞—î—Ç—å—Å—è –∑ —É—Ä–∞—Ö—É–≤–∞–Ω–Ω—è–º –≤–∏—Ç—Ä–∞—Ç, –ø–æ–≤&rsquo;—è–∑–∞–Ω–∏—Ö –∑ –ø—Ä–∏–¥–±–∞–Ω–Ω—è–º –±–ª–∞–Ω–∫–æ–≤–æ—ó –ø—Ä–æ–¥—É–∫—Ü—ñ—ó.</p>\r\n','<p>---</p>\r\n','<p>–ù–µ –ø—ñ–∑–Ω—ñ—à–µ 30 –∫–∞–ª–µ–Ω–¥–∞—Ä–Ω–∏—Ö –¥–Ω—ñ–≤, —É —Ä–∞–∑—ñ —Ç–µ—Ä–º—ñ–Ω–æ–≤–æ–≥–æ –Ω–∞–¥–∞–Ω–Ω—è&nbsp; –ø–æ—Å–ª—É–≥–∏ &ndash; 10 —Ä–æ–±–æ—á–∏—Ö –¥–Ω—ñ–≤.</p>\r\n','<p>–ì—Ä–æ–º–∞–¥—è–Ω–∏–Ω—É (—É —Ä–∞–∑—ñ –¥–æ—Å—è–≥–Ω–µ–Ω–Ω—è 14 —Ä—ñ—á–Ω–æ–≥–æ –≤—ñ–∫—É)&nbsp; –º–æ–∂–µ –±—É—Ç–∏ —Ç–∏–º—á–∞—Å–æ–≤–æ –≤—ñ–¥–º–æ–≤–ª–µ–Ω–æ —É —Ä–∞–∑—ñ, –∫–æ–ª–∏:</p>\r\n\r\n<ol>\r\n	<li>–¥—ñ—é—Ç—å –Ω–µ–≤—Ä–µ–≥—É–ª—å–æ–≤–∞–Ω—ñ –∞–ª—ñ–º–µ–Ω—Ç–Ω—ñ, –¥–æ–≥–æ–≤—ñ—Ä–Ω—ñ —á–∏ —ñ–Ω—à—ñ –Ω–µ–≤–∏–∫–æ–Ω–∞–Ω—ñ –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω–Ω—è, - –¥–æ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω—å –∞–±–æ —Ä–æ–∑–≤&rsquo;—è–∑–∞–Ω–Ω—è —Å–ø–æ—Ä—É –∑–∞ –ø–æ–≥–æ–¥–∂–µ–Ω–Ω—è–º —Å—Ç–æ—Ä—ñ–Ω —É –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–∏—Ö –∑–∞–∫–æ–Ω–æ–º –≤–∏–ø–∞–¥–∫–∞—Ö, —á–∏ –∑–∞–±–µ–∑–ø–µ—á–µ–Ω–Ω—è –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω—å –∑–∞—Å—Ç–∞–≤–æ—é, —è–∫—â–æ —ñ–Ω—à–µ –Ω–µ –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–æ –º—ñ–∂–Ω–∞—Ä–æ–¥–Ω–∏–º –¥–æ–≥–æ–≤–æ—Ä–æ–º –£–∫—Ä–∞—ó–Ω–∏;</li>\r\n	<li>—Å—Ç–æ—Å–æ–≤–Ω–æ –Ω—å–æ–≥–æ –≤ –ø–æ—Ä—è–¥–∫—É, –ø–µ—Ä–µ–¥–±–∞—á–µ–Ω–æ–º—É –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–∏–º –ø—Ä–æ—Ü–µ—Å—É–∞–ª—å–Ω–∏–º –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤–æ–º, –∑–∞—Å—Ç–æ—Å–æ–≤–∞–Ω–æ –∑–∞–ø–æ–±—ñ–∂–Ω–∏–π –∑–∞—Ö—ñ–¥, –∑–∞ —É–º–æ–≤–∞–º–∏ —è–∫–æ–≥–æ –π–æ–º—É –∑–∞–±–æ—Ä–æ–Ω–µ–Ω–æ –≤–∏—ó–∂–¥–∂–∞—Ç–∏ –∑–∞ –∫–æ—Ä–¥–æ–Ω, - –¥–æ –∑–∞–∫—ñ–Ω—á–µ–Ω–Ω—è –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–æ–≥–æ –ø—Ä–æ–≤–∞–¥–∂–µ–Ω–Ω—è –∞–±–æ —Å–∫–∞—Å—É–≤–∞–Ω–Ω—è –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–∏—Ö –æ–±–º–µ–∂–µ–Ω—å;</li>\r\n	<li>–≤—ñ–Ω –∑–∞—Å—É–¥–∂–µ–Ω–∏–π –∑–∞ –≤—á–∏–Ω–µ–Ω–Ω—è –∫—Ä–∏–º—ñ–Ω–∞–ª—å–Ω–æ–≥–æ –ø—Ä–∞–≤–æ–ø–æ—Ä—É—à–µ–Ω–Ω—è, - –¥–æ –≤—ñ–¥–±—É—Ç—Ç—è –ø–æ–∫–∞—Ä–∞–Ω–Ω—è –∞–±–æ –∑–≤—ñ–ª—å–Ω–µ–Ω–Ω—è</li>\r\n	<li>–≤—ñ–Ω —É—Ö–∏–ª—è—î—Ç—å—Å—è –≤—ñ–¥ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω—å, –ø–æ–∫–ª–∞–¥–µ–Ω–∏—Ö –Ω–∞ –Ω—å–æ–≥–æ —Å—É–¥–æ–≤–∏–º —Ä—ñ—à–µ–Ω–Ω—è–º, —Ä—ñ—à–µ–Ω–Ω—è–º —ñ–Ω—à–æ–≥–æ –æ—Ä–≥–∞–Ω—É (–ø–æ—Å–∞–¥–æ–≤–æ—ó –æ—Å–æ–±–∏), - –¥–æ –≤–∏–∫–æ–Ω–∞–Ω–Ω—è –∑–æ–±–æ–≤&rsquo;—è–∑–∞–Ω—å;</li>\r\n	<li>–≤—ñ–Ω —Å–≤—ñ–¥–æ–º–æ —Å–ø–æ–≤—ñ—Å—Ç–∏–≤ –ø—Ä–æ —Å–µ–±–µ –Ω–µ–ø—Ä–∞–≤–¥–∏–≤—ñ –≤—ñ–¥–æ–º–æ—Å—Ç—ñ, - –¥–æ –∑&rsquo;—è—Å—É–≤–∞–Ω–Ω—è –ø—Ä–∏—á–∏–Ω —ñ –Ω–∞—Å–ª—ñ–¥–∫—ñ–≤ –ø–æ–¥–∞–Ω–Ω—è –Ω–µ–ø—Ä–∞–≤–¥–∏–≤–∏—Ö –≤—ñ–¥–æ–º–æ—Å—Ç–µ–π;</li>\r\n	<li>—â–æ–¥–æ –Ω—å–æ–≥–æ –ø–æ–¥–∞–Ω–æ —Ü–∏–≤—ñ–ª—å–Ω–∏–π –ø–æ–∑–æ–≤ –¥–æ —Å—É–¥—É, - –¥–æ –∑–∞–∫—ñ–Ω—á–µ–Ω–Ω—è –ø—Ä–æ–≤–∞–¥–∂–µ–Ω–Ω—è —É —Å–ø—Ä–∞–≤—ñ;</li>\r\n	<li>–≤—ñ–Ω –ø–µ—Ä–µ–±—É–≤–∞—î –ø—ñ–¥ –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏–º –Ω–∞–≥–ª—è–¥–æ–º –æ—Ä–≥–∞–Ω—ñ–≤ –≤–Ω—É—Ç—Ä—ñ—à–Ω—ñ—Ö —Å–ø—Ä–∞–≤, -&nbsp; –¥–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è –Ω–∞–≥–ª—è–¥—É.&nbsp;</li>\r\n</ol>\r\n','<p>–í–∏–¥–∞—á–∞ –ø—Ä–æ—ó–∑–Ω–æ–≥–æ –¥–æ–∫—É–º–µ–Ω—Ç—É –¥–∏—Ç–∏–Ω–∏ –¥–ª—è –≤–∏—ó–∑–¥—É –∑–∞ –∫–æ—Ä–¥–æ–Ω.</p>\r\n','<p>–ó–≤–µ—Ä–Ω—É—Ç–∏—Å—è &nbsp;–¥–æ —Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ–≥–æ –æ—Ä–≥–∞–Ω—É (–ø—ñ–¥—Ä–æ–∑–¥—ñ–ª—É) –î–ú–° –∞–±–æ —Ü–µ–Ω—Ç—Ä—É –Ω–∞–¥–∞–Ω–Ω—è –∞–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏—Ö –ø–æ—Å–ª—É–≥.</p>\r\n','–Ω—ñ',0,'',0,'','','',''),(119,'–í–Ω–µ—Å–µ–Ω–Ω—è –¥–æ –Ñ–¥–∏–Ω–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤ –∑–∞–ø–∏—Å—É –ø—Ä–æ —Ä—ñ—à–µ–Ω–Ω—è –∑–∞—Å–Ω–æ–≤–Ω–∏–∫—ñ–≤ (—É—á–∞—Å–Ω–∏–∫—ñ–≤) —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ –∞–±–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–∏–º –Ω–∏–º–∏ –æ—Ä–≥–∞–Ω–æ–º —â–æ–¥–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏\r\n',17,17,'<ol>\r\n	<li>–ó–∞–∫–æ–Ω –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 15.05.2003 ‚Ññ 755-IV &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot; (–∑—ñ&nbsp; –∑–º—ñ–Ω–∞–º–∏&nbsp; —Ç–∞&nbsp; –¥–æ–ø–æ–≤–Ω–µ–Ω–Ω—è–º–∏)&nbsp;(—Å—Ç–∞—Ç—Ç—ñ 8, 34, 35).</li>\r\n	<li>–ù–∞–∫–∞–∑ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤–∞ —é—Å—Ç–∏—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ –≤—ñ–¥ 17.04.2013 &nbsp;‚Ññ 730/5 &quot;–ü—Ä–æ –∑–∞—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è —Ñ–æ—Ä–º –∑–∞—è–≤ —Ç–∞ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω—å, –Ω–∞–¥–∞–Ω–Ω—è (–Ω–∞–¥—Å–∏–ª–∞–Ω–Ω—è) —è–∫–∏—Ö –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–æ –ó–∞–∫–æ–Ω–æ–º –£–∫—Ä–∞—ó–Ω–∏ &quot;–ü—Ä–æ –¥–µ—Ä–∂–∞–≤–Ω—É —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ—é —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤&quot;, –∑–∞—Ä–µ—î—Å—Ç—Ä–æ–≤–∞–Ω–∏–π –≤ –ú—ñ–Ω—ñ—Å—Ç–µ—Ä—Å—Ç–≤—ñ —é—Å—Ç–∏—Ü—ñ—ó –£–∫—Ä–∞—ó–Ω–∏ 24.04.2013 –∑–∞ ‚Ññ 671/23203.</li>\r\n</ol>\r\n','<p>–ó–≤–µ—Ä–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ —É –∑–≤&rsquo;—è–∑–∫—É —ñ–∑ —Ä—ñ—à–µ–Ω–Ω—è–º –∑–∞—Å–Ω–æ–≤–Ω–∏–∫—ñ–≤ (—É—á–∞—Å–Ω–∏–∫—ñ–≤) —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ –∞–±–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–∏–º –Ω–∏–º–∏ –æ—Ä–≥–∞–Ω–æ–º —â–æ–¥–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏.</p>\r\n','<p>–î–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞—é—Ç—å—Å—è (–Ω–∞–¥—Å–∏–ª–∞—é—Ç—å—Å—è&nbsp; –ø–æ—à—Ç–æ–≤–∏–º –≤—ñ–¥–ø—Ä–∞–≤–ª–µ–Ω–Ω—è–º –∑&nbsp; –æ–ø–∏—Å–æ–º&nbsp; –≤–∫–ª–∞–¥–µ–Ω–Ω—è) –∑–∞—è–≤–Ω–∏–∫–æ–º.</p>\r\n','<ol>\r\n	<li>–û—Ä–∏–≥—ñ–Ω–∞–ª –∞–±–æ –Ω–æ—Ç–∞—Ä—ñ–∞–ª—å–Ω–æ –∑–∞—Å–≤—ñ–¥—á–µ–Ω–∞ –∫–æ–ø—ñ—è —Ä—ñ—à–µ–Ω–Ω—è –∑–∞—Å–Ω–æ–≤–Ω–∏–∫—ñ–≤ (—É—á–∞—Å–Ω–∏–∫—ñ–≤) –∞–±–æ —É–ø–æ–≤–Ω–æ–≤–∞–∂–µ–Ω–æ–≥–æ –Ω–∏–º–∏&nbsp; –æ—Ä–≥–∞–Ω—É —â–æ–¥–æ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏.</li>\r\n	<li>&nbsp;–î–æ–¥–∞—Ç–∫–æ–≤–æ –ø–æ–¥–∞—î—Ç—å—Å—è:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>–î–æ–∫—É–º–µ–Ω—Ç, —è–∫–∏–π –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂—É—î –æ–¥–µ—Ä–∂–∞–Ω–Ω—è –∑–≥–æ–¥–∏ –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–∏—Ö –¥–µ—Ä–∂–∞–≤–Ω–∏—Ö –æ—Ä–≥–∞–Ω—ñ–≤ –Ω–∞ –ø—Ä–∏–ø–∏–Ω–µ–Ω–Ω—è —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ &ndash; —É –≤–∏–ø–∞–¥–∫–∞—Ö, –≤—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏—Ö –∑–∞–∫–æ–Ω–æ–º.</li>\r\n</ul>\r\n\r\n<p><em>&nbsp;–Ø–∫—â–æ –¥–æ–∫—É–º–µ–Ω—Ç–∏ –ø–æ–¥–∞—é—Ç—å—Å—è –æ—Å–æ–±–æ—é, —è–∫–∞ –∑–≥—ñ–¥–Ω–æ –∑ –≤—ñ–¥–æ–º–æ—Å—Ç—è–º–∏, –≤–Ω–µ—Å–µ–Ω–∏–º–∏ –¥–æ –Ñ–¥–∏–Ω–æ–≥–æ –¥–µ—Ä–∂–∞–≤–Ω–æ–≥–æ —Ä–µ—î—Å—Ç—Ä—É —é—Ä–∏–¥–∏—á–Ω–∏—Ö –æ—Å—ñ–± —Ç–∞ —Ñ—ñ–∑–∏—á–Ω–∏—Ö –æ—Å—ñ–± &ndash; –ø—ñ–¥–ø—Ä–∏—î–º—Ü—ñ–≤, –º–∞—î –ø—Ä–∞–≤–æ –≤—á–∏–Ω—è—Ç–∏ —é—Ä–∏–¥–∏—á–Ω—ñ –¥—ñ—ó –≤—ñ–¥ —ñ–º–µ–Ω—ñ —é—Ä–∏–¥–∏—á–Ω–æ—ó –æ—Å–æ–±–∏ –±–µ–∑&nbsp; –¥–æ–≤—ñ—Ä–µ–Ω–æ—Å—Ç—ñ,&nbsp; –ø—Ä–µ–¥&#39;—è–≤–ª—è—î—Ç—å—Å—è –ø–∞—Å–ø–æ—Ä—Ç –≥—Ä–æ–º–∞–